INSERT INTO `artikel` (`id`, `titel`, `content`, `status`, `kat_id`, `ukat_id`, `premium`, `bild_name`, `date_created`, `date_modified`) VALUES
(24, 'Umlage der Betriebskosten auf die Personenzahl', '<p><strong><span style="font-size: small;"><span style="color: #993300;"><span style="font-size: medium;">Bei Umlage der Betriebskosten auf die Personenzahl muss der Vermieter die tats&auml;chliche Anzahl der Bewohner ermitteln</span></span></span></strong></p>\r\n<p><strong><span style="font-size: small;">Nach einer Entscheidung des Bundesgerichtshofs ist es in den F&auml;llen, in denen die Umlage der Betriebskosten vertraglich anhand der Personenzahl erfolgen soll, die Aufgabe des Vermieters die genaue Bewohnerzahl zu ermitteln. Der Vermieter darf sich hierbei auch nicht auf Ausk&uuml;nfte aus den Einwohnermeldeamtsregistern st&uuml;tzen. </span></strong></p>\r\n<p><strong><span style="color: #993300;"><span style="font-size: small;">Kein Vertrauen auf die korrekte Darstellung der Melderegister</span></span></strong></p>\r\n<p><span style="font-size: small;">Nach Auffassung des BGH kann zur Feststellung des tats&auml;chlichen Belegungsstands w&auml;hrend des Abrechnungszeitraumes, nicht auf die Eintragungen in den Melderegistern zur&uuml;ck gegriffen werden.&nbsp;Diese seien&nbsp;nicht aktuell genug und&nbsp;h&auml;ufig und auch nicht richtig, da sich nicht alle Personen zeitnah ummelden. Vor allem bei einer m&ouml;glichen wechselhaften Belegung der Wohnung w&auml;hrend des Abrechnungszeitraums, k&ouml;nnten die Melderegister keine hinreichende Historie anbieten, da bei kurzfristigen Aufenthalten eine Meldung des Bewohners erfahrungsgem&auml;&szlig; nicht erfolge.</span></p>\r\n<p><strong><span style="color: #993300;"><span style="font-size: small;">Kritik</span></span></strong></p>\r\n<p><span style="font-size: small;">Die Problematik die sich f&uuml;r den Vermieter hieraus ergibt,&nbsp;erkennt der BGH durchaus&nbsp;und f&uuml;hrte in seiner benannten Entscheidung&nbsp;selber aus,&nbsp;dass es f&uuml;r den Vermieter wohl&nbsp;schwierig sein k&ouml;nnte, den genauen Belegungsstand einer Wohnung w&auml;hrend des Abrechnungszeitraums zu bestimmen. Gleichwohl blieb der BGH auf dieses Problem eine Antwort schuldig. Dies wiegt um so schwerer, da der Vermieter wohl nicht nur verpflichtet ist, den genauen Belegungsstand w&auml;hrend des Abrechnungszeitraums zu ermitteln, vielmehr m&uuml;sste er diesen Belegungsstand im Zweifel vor Gericht auch beweisen. Gerade bei wechselhafter Belegung wird dies fast unm&ouml;glich sein.</span></p>\r\n<p><strong><span style="color: #993300;"><span style="font-size: small;">Fazit:</span></span></strong></p>\r\n<p><span style="font-size: small;">Vermieter d&uuml;rften k&uuml;nftig bem&uuml;ht sein vertraglich festzulegen, Betriebskosten nicht mehr nach der Personenzahl umzulegen (sondern z. B. nach der Wohnfl&auml;che). Dies kann in Einzelf&auml;llen zu einer Benachteiligung von alleine wohnenden Mietern f&uuml;hren.</span></p>\r\n<p><strong><span style="font-size: small;"><span style="color: #993300;">Bundesgerichtshof, Urteil vom 23. Januar 2008, </span></span></strong></p>\r\n<p><strong><span style="font-size: small;"><span style="color: #993300;">Aktenzeichen VIII ZR 82/07</span></span></strong></p>\r\n<p><span style="font-size: small;">Foto: Digipic fololia</span></p>', 0, 2, 11, 1, '4ad5df267a745.JPG', '2009-09-23 21:11:46', '0000-00-00 00:00:00'),
(22, 'Umwälzung der Renovierungsverpflichtung auf den Mieter – Klauseln oft unwirksam', '<h3><span style="color: #993300;"><span style="font-size: medium;">Umw&auml;lzung der Renovierungsverpflichtung auf den Mieter &ndash; Klauseln oft unwirksam</span></span></h3>\r\n<p><strong><span style="font-size: small;">Generell ist die Renovierung der Wohnung Sache des Vermieters. Durch Klauseln in Mietvertr&auml;gen wird diese Verpflichtung des Vermieters im Bereich der sogenannten Sch&ouml;nheitsreparaturen oftmals auf den Mieter &uuml;bertragen. In einer Entscheidung vom 23. Juni 2004 stellte der Bundesgerichtshof klar, dass solche Klauseln zumindest dann den Mieter unangemessen benachteiligen, wenn die Verpflichtung zur Renovierung unabh&auml;ngig von der Notwendigkeit zur Renovierung in dem Mietvertrag festgeschrieben ist.</span></strong></p>\r\n<h3><span style="font-size: xx-small;"><span style="color: #993300;"><span style="font-size: small;">Starre Fristenregelungen unwirksam</span></span></span></h3>\r\n<p><span style="font-size: small;">Hierunter fallen Formulierungen wie: &bdquo;Die K&uuml;che ist alle drei Jahre zu renovieren&ldquo; oder &bdquo;Wohnr&auml;ume m&uuml;ssen alle f&uuml;nf Jahre renoviert werden&ldquo;. In diesen F&auml;llen sind die Fristen, in denen der Mieter die Renovierung vornehmen muss, starr geregelt. Es ist jedoch m&ouml;glich, dass die Mietr&auml;ume zu dem vorgeschriebenen Zeitpunkt noch gar nicht in einem renovierungsbed&uuml;rftigen Zustand sind. Da der Mieter gem&auml;&szlig; einer solchen Klausel dennoch zur Renovierung verpflichtet werden soll, hat der BGH in seiner oben benannten Entscheidung festgelegt, dass entsprechende Renovierungsklauseln mit starren Fristenregeln unwirksam sind.</span></p>\r\n<p><strong><span style="color: #993300;"><span style="font-size: small;">Wirksamkeit von offenen Klauseln</span></span></strong></p>\r\n<p><span style="font-size: small;">Wirksam bleiben jedoch solche Klauseln, die nicht starr gefasst sind. Hierunter fallen Formulierungszus&auml;tze wie: &bdquo;<span style="text-decoration: underline;">im allgemeinen</span> alle drei Jahre&ldquo; oder <span style="text-decoration: underline;">grunds&auml;tzlich</span> alle f&uuml;nf Jahre&ldquo;. Ebenfalls kann die Fristenklausel ihre Wirksamkeit behalten durch einen Zusatz wie: &bdquo;Wenn es der Zustand der R&auml;umlichkeit erfordert&ldquo;.</span></p>\r\n<p><strong><span style="color: #993300;"><span style="font-size: small;">Unangemessene Benachteiligung</span></span></strong></p>\r\n<p><span style="font-size: small;">Der BGH begr&uuml;ndet die Unwirksamkeit von Renovierungsklauseln mit starren Fristenregelungen damit, dass hierin eine unangemessene Benachteiligung des Mieters liege. Der BGH ist der Auffassung, dass eine Renovierungsverpflichtung von der Renovierungsnotwendigkeit abh&auml;ngig sein muss. Wird der Mieter hingegen zur Renovierung verpflichtet, blo&szlig; weil ein bestimmter Zeitablauf vorliege, so werde er zu einer Handlung gezwungen, die ggf. wirtschaftlich nicht sinnvoll ist (wenn n&auml;mlich noch kein Renovierungsbedarf besteht) und die der Vermieter nicht vornehmen w&uuml;rde, wenn er selber zur Renovierung verpflichtet geblieben w&auml;re.</span></p>\r\n<p><strong><span style="color: #993300;"><span style="font-size: small;">Folgen der Unwirksamkeit</span></span></strong></p>\r\n<p><span style="font-size: small;">Da generell der Vermieter zur Renovierung verpflichtet ist und diese Verpflichtung lediglich durch eine Vertragsklausel auf den Mieter &uuml;bertragen wird, f&uuml;hrt die Unwirksamkeit einer Renovierungsklausel im Mietvertrag automatisch zur Wiederherstellung des gesetzlichen Zustandes. Dies bedeutet, dass im Falle der Unwirksamkeit von Renovierungsklauseln im Mietvertrag, der Vermieter verpflichtet ist, etwaige Renovierungsma&szlig;nahmen dann zu ergreifen, wenn dies der Zustand der Wohnung aufgrund von gew&ouml;hnlicher Abnutzung erfordert.</span></p>\r\n<p><strong><span style="font-size: small;"><span style="color: #993300;">Bundesgerichtshof, Urteil vom 23. Juni 2004, </span></span></strong></p>\r\n<p><strong><span style="font-size: small;"><span style="color: #993300;">Aktenzeichen VIII ZR 361/03</span></span></strong></p>\r\n<p><span style="font-size: small;">Photo: SyB Fotolia</span></p>', 0, 2, 8, 1, '4ad5e88668f30.JPG', '2009-09-23 21:04:08', '0000-00-00 00:00:00'),
(23, 'Rückerstattung von Endrenovierungskosten', '<p><span style="font-size: small;"><strong><span style="color: #993300;"><span style="font-size: medium;">R&uuml;ckerstattung von Endrenovierungskosten bei unwirksamer Renovierungsklausel</span></span></strong></span></p>\r\n<p><strong><span style="font-size: small;">Erbringt der Mieter aufgrund einer unwirksamen Renovierungsklausel eine Endrenovierungsleistung, kann - nach einer Entscheidung des Bundesgerichtshofs vom 27.05.2009 - der Vermieter zur R&uuml;ckzahlung der diesbez&uuml;glichen Kosten verpflichtet sein.</span></strong></p>\r\n<p><strong><span style="font-size: x-small;"><span style="color: #993300;"><span style="font-size: small;">Ung&uuml;ltige Renovierungsklausel</span></span></span></strong></p>\r\n<p><span style="font-size: small;">Sowohl viele Klauseln zur Verpflichtung des Mieters zur Durchf&uuml;hrung von Sch&ouml;nheitsreparaturen, als auch zur Vornahme einer Endrenovierung, sind unwirksam. Da die gesetzliche Regelung vorsieht, dass der Vermieter zur Durchf&uuml;hrung von Renovierungsma&szlig;nahmen verpflichtet ist, f&uuml;hrt die Unwirksamkeit einer &ndash; vertraglichen &ndash; Renovierungsklausel, die eigentlich den Mieter zur Vornahme der Renovierung verpflichtet h&auml;tte, wieder zur gesetzlichen Regelung.</span></p>\r\n<p><span style="font-size: x-small;"><span style="color: #993300;"><strong><span style="font-size: small;">Renovierungsvornahme durch den Mieter</span></strong></span></span></p>\r\n<p><span style="font-size: small;">Wenn der Mieter im Vertrauen auf die Wirksamkeit einer Renovierungsklausel bei Auszug aus der Wohnung eine Renovierung vornimmt, ist der Vermieter hierdurch im Wert der Renovierungsma&szlig;nahme bereichert, da der Mieter die Renovierung nicht h&auml;tte vornehmen m&uuml;ssen und der Vermieter seine Wohnung in einem besseren Zustand zur&uuml;ck erh&auml;lt. Mit seiner Entscheidung vertritt der BGH jedoch die Auffassung, dass die Verwendung von Renovierungsklauseln im Risikobereich des Vermieters liegen. Sind die Klauseln unwirksam und hatte der Mieter jedoch auf die Wirksamkeit der Klauseln vertraut, muss der Vermieter hierf&uuml;r gerade stehen. Aus diesem Grund spricht der Bundesgerichtshof dem Mieter einen Ersatzanspruch gegen&uuml;ber dem Vermieter zu.</span></p>\r\n<p><span style="font-size: x-small;"><strong><span style="color: #993300;"><span style="font-size: small;">H&ouml;he des Erstattungsanspruchs</span></span></strong></span></p>\r\n<p><span style="font-size: small;">Da etwaige Renovierungsma&szlig;nahmen des Mieters h&auml;ufig in Eigenleistung oder durch Freunde und Bekannte durchgef&uuml;hrt werden, muss der Wert der Renovierungsleistung vom Gericht gesch&auml;tzt werden. Der Anspruch richtet sich nach dem Wert der erbrachten Leistung.</span></p>\r\n<p><span style="font-size: x-small;"><strong><span style="color: #993300;"><span style="font-size: small;">Kritik</span></span></strong></span></p>\r\n<p><span style="font-size: small;">Die Vermieter kritisieren an dieser Entscheidung, dass der BGH den Wert der Renovierungsleistung daran messen will, was der Mieter hierf&uuml;r aufgewendet hatte, bzw. h&auml;tte aufwenden m&uuml;ssen. Tats&auml;chlich k&ouml;nne jedoch nur die Leistung erstattet werden, die der Vermieter erhalte. Da die Renovierungen jedoch h&auml;ufig von dem Mieter nicht fachm&auml;nnisch durchgef&uuml;hrt w&uuml;rde, sei die Leistung die der Vermieter erh&auml;lt, nicht in dem Wert vorhanden, den der Vermieter dem Mieter ersetzen m&uuml;sste.</span></p>\r\n<p><strong><span style="font-size: small;"><span style="color: #993300;">Bundesgerichtshof, Urteil vom 27. Mai 2009, </span></span></strong></p>\r\n<p><strong><span style="font-size: small;"><span style="color: #993300;">Aktenzeichen VIII ZR 302/07</span></span></strong></p>\r\n<p><span style="font-size: small;">Photo: Aamon Fotolia</span></p>', 0, 2, 8, 1, '4ad5e914a1ddf.JPG', '2009-09-23 21:07:50', '0000-00-00 00:00:00'),
(19, 'BGH zur Unzulässigkeit von doppelten Renovierungsklauseln', '<p><span style="font-size: small;"><span style="color: #993300;"><strong><span style="font-size: medium;">BGH zur Unzul&auml;ssigkeit von doppelten Renovierungsklauseln</span></strong></span></span></p>\r\n<p><strong><span style="font-size: small;">Nach einer Entscheidung des Bundesgerichtshofs vom 14.05.2003 kann eine doppelte Regelung von Renovierungsverpflichtungen des Mieters, diesen unangemessen benachteiligen und zu einer Unwirksamkeit beider Renovierungsklauseln f&uuml;hren.</span></strong></p>\r\n<p><span style="color: #993300;"><strong><span style="font-size: small;">Doppelte Renovierungsverpflichtung</span></strong></span></p>\r\n<p><span style="font-size: small;">In dem vom BGH entschiedenen Fall war in dem Mietvertrag eine Regelung enthalten, nach welcher der Mieter zur &Uuml;bernahme von Sch&ouml;nheitsreparaturen verpflichtet war. Gleichzeitig war geregelt, dass der Mieter im Falle der Beendigung des Mietverh&auml;ltnisses vor der Wohnungsr&uuml;ckgabe eine Endrenovierung vorzunehmen habe.</span></p>\r\n<p><span style="font-size: x-small;"><span style="color: #993300;"><strong><span style="font-size: small;">Unangemessene Benachteiligung</span></strong></span></span></p>\r\n<p><span style="font-size: small;">Der Mieter ist bei einer solchen Konstellation nach Meinung des BGH unangemessen benachteiligt, da bei einer regelm&auml;&szlig;igen Vornahme von Sch&ouml;nheitsreparaturen, eine Endrenovierung nicht mehr notwendig sei. Schlie&szlig;lich habe der Mieter durch die Vornahme der Sch&ouml;nheitsreparaturen den Wohnwert erhalten.</span></p>\r\n<p><strong><span style="color: #993300;"><span style="font-size: small;">Beide Klauseln unwirksam</span></span></strong></p>\r\n<p><span style="font-size: small;">In einer solchen Konstellation seien beide Renovierungsklauseln unwirksam. Folglich muss der Mieter in diesen F&auml;llen weder Sch&ouml;nheitsreparaturen durchf&uuml;hren, noch eine Endrenovierung vornehmen.</span></p>\r\n<p><strong><span style="font-size: small;"><span style="color: #993300;">Bundesgerichtshof, Urteil vom 14.05.2003 </span></span></strong></p>\r\n<p><strong><span style="font-size: small;"><span style="color: #993300;">Aktenzeichen VIII ZR 308/02</span></span></strong></p>\r\n<p><span style="font-size: small;">&nbsp;Photo: Patriezia-Design Fotolia</span></p>', 0, 2, 8, 1, '4ad602a69a68f.JPG', '2009-09-23 20:24:55', '0000-00-00 00:00:00'),
(17, 'Abrechnungsmethode bei der Betriebskostenabrechnung', '<p><strong><strong><span style="font-size: small;"><span style="color: #993300;"><span style="font-size: medium;">Abrechnungsmethode bei der Betriebskostenabrechnung</span></span></span></strong></strong></p>\r\n<p><strong><span style="font-size: small;">In der Frage, ob der Vermieter dem Mieter die Kosten in Rechnung stellen darf, die ihm selber in dem Abrechnungszeitraum in Rechnung gestellt worden waren oder ob er von dem Mieter nur verlangen kann, was der Mieter in dem betreffenden Abrechnungszeitraum auch verbraucht hatte, urteilte der Bundesgerichtshof, zugunsten der Vermieter, dass diese vom Mieter alle Kosten verlangen k&ouml;nnen, die dem Vermieter selber in dem Abrechnungszeitraum f&uuml;r den Mietraum entstanden sind. </span></strong></p>\r\n<p><strong><span style="color: #993300;"><span style="font-size: small;">Abflussprinzip</span></span></strong></p>\r\n<p><span style="font-size: small;">Damit entschied sich der BGH daf&uuml;r, dass der Vermieter nach dem sogenannten Abflussprinzip abrechnen darf. Er darf also alle Nebenkostenzahlungen in Ansatz bringen, die er in dem betreffenden Abrechnungszeitraum f&uuml;r den Mietraum leisten musste.</span></p>\r\n<p><strong><span style="color: #993300;"><span style="font-size: small;">Differenz zu dem tats&auml;chlichen Verbrauch</span></span></strong></p>\r\n<p><span style="font-size: small;">Eine Differenz zu dem tats&auml;chlich Verbrauch des Mieters kann entstehen, da bei dem Abflussprinzip die Kosten der zu leistenden Vorauszahlungen an den Versorger (durch den Vermieter) und etwaige Nachzahlungen Ber&uuml;cksichtigung finden. Da also nur nach den in dem Abrechnungszeitraum entstandenen Kosten und nicht nach dem Verbrauch abgerechnet wird, kann eine Differenz zwischen beiden Werten zugunsten des Mieter oder zum Nachteil des Mieters entstehen.</span></p>\r\n<p><strong><span style="color: #993300;"><span style="font-size: small;">Unzumutbarkeit f&uuml;r den Vermieter</span></span></strong></p>\r\n<p><span style="font-size: small;">Nach Meinung des BGH w&auml;re eine Abrechnung nach dem tats&auml;chlichen Verbrauch f&uuml;r den Vermieter nicht zumutbar. Dies w&uuml;rde n&auml;mlich bedeuten, dass der Vermieter die Abweichung zwischen tats&auml;chlichen Zahlungen und tats&auml;chlichem Verbrauch des jeweiligen Mieters selber ermitteln m&uuml;sste und eine etwaige Differenz selber vorzufinanzieren habe.</span></p>\r\n<p><strong><span style="color: #993300;"><span style="font-size: small;">Kritik</span></span></strong></p>\r\n<p><span style="font-size: small;">Wohnt der Mieter viele Jahre in dem selben Mietobjekt, wirkt sich eine Abrechnung nach dem Abflussprinzip f&uuml;r ihn nicht nachteilig aus, da eine etwaige Nachzahlung in dem einen Jahr auf seinem (h&ouml;heren) Verbrauch aus dem Vorjahr beruht. Werden in einem Jahr zu hohe Vorauszahlungen von dem Versorger verlangt, kommt der Mieter in dem darauf folgenden Jahr in den Genuss einer Erstattung. Problematisch wird die Abrechnungsmethode jedoch f&uuml;r Mieter, die h&auml;ufiger ihren Wohnraum wechseln m&uuml;ssen oder wollen. An anderer Stelle hatte der BGH jedoch ausgef&uuml;hrt, dass die Abrechnung nach dem Abflussprinzip bei einem Mieterwechsel unzul&auml;ssig sein k&ouml;nnte.</span></p>\r\n<p><strong><span style="font-size: small;"><span style="color: #993300;">Bundesgerichtshof, Urteil vom 20. Februar 2008 </span></span></strong></p>\r\n<p><strong><span style="font-size: small;"><span style="color: #993300;">Aktenzeichen VIII ZR 49/07</span></span></strong></p>\r\n<p><span style="font-size: small;">Photo: Andre Bonn - Fotolia.com</span></p>', 0, 2, 11, 1, '4addf798c4ffe.', '2009-09-23 20:12:03', '0000-00-00 00:00:00'),
(18, 'Betriebskosten; Abweichung der tatsächlichen Wohnfläche von der Angabe im Mietvertrag', '<p><strong><strong><span style="font-size: small;"><span style="color: #993300;"><span style="font-size: medium;">Umlage von Betriebskosten; Abweichung der tats&auml;chlichen Wohnfl&auml;che von der Angabe im Mietvertrag; Nachforderung von nicht geleisteten Vorauszahlungen.</span></span></span></strong></strong></p>\r\n<p><strong><span style="font-size: small;">In einer Entscheidung aus Oktober 2007 hat der Bundesgerichtshof zu drei mietrechtlichen Problemen bei der Nebenkostenabrechnung Stellung bezogen. Zum einen ging es um die Frage, ob die Positionen Warmwasser und Heizung alleine nach der Wohnfl&auml;che umgelegt werden d&uuml;rfen, wenn eine verbrauchsabh&auml;ngige Abrechnung nicht (mehr) m&ouml;glich ist. Des weiteren urteilte der BGH zu dem Streitpunkt, welcher Wert bei einem Abweichen von tats&auml;chlicher zu vereinbarter Wohnfl&auml;che zu Grunde zu legen ist. Schlie&szlig;lich ging es um das Problem, ob nicht geleistete Betriebskostenvorauszahlungen eingefordert werden k&ouml;nnen, wenn die Betriebskosten verfristet abgerechnet wurden.</span></strong></p>\r\n<p><strong><span style="color: #993300;"><span style="font-size: small;">Umlage der Nebenkostenpositionen Warmwasser und Heizung</span></span></strong></p>\r\n<p><span style="font-size: small;">Nach dem Gesetz (&sect; 7 Abs. 1, 3 HeizkostenV) ist der Vermieter verpflichtet, mindestens 50, h&ouml;chstens 70 % der Heizkosten nach dem erfassten Verbrauch abzurechnen. &Auml;hnliches gilt f&uuml;r das Warmwasser. In dem vom BGH zu l&ouml;senden Fall war eine Verbrauchserfassung nicht (mehr) m&ouml;glich und der Vermieter hatte daher diese Positionen nach der Wohnfl&auml;che, unter Abzug von 15 % des auf den Mieters anfallenden Kostenanteils umgelegt. Dem stimmte das Gericht zu.</span></p>\r\n<p><strong><span style="color: #993300;"><span style="font-size: small;">Abweichung der tats&auml;chlichen Wohnfl&auml;che von den Angaben im Mietvertrag</span></span></strong></p>\r\n<p><span style="font-size: small;">Das Gericht hielt eine Abweichung der tats&auml;chlichen Wohnfl&auml;che von den Angaben in dem Mietvertrag nicht f&uuml;r ma&szlig;geblich, wenn diese Abweichung &ndash; wie in dem zu entscheidenden Fall &ndash; weniger als 10 % betr&auml;gt. Allerdings l&auml;sst sich hieraus der R&uuml;ckschluss ziehen, dass eine Abweichung von mehr als 10 % ins Gewicht fallen w&uuml;rde.</span></p>\r\n<p><strong><span style="color: #993300;"><span style="font-size: small;">Nachforderung der Betriebskostenvorauszahlung trotz versp&auml;teter Betriebskostenabrechnung</span></span></strong></p>\r\n<p><span style="font-size: small;">Erstellt der Vermieter eine Betriebskostenabrechnung erst nach der Jahresfrist gem&auml;&szlig; &sect; 556 Abs. 3 BGB, kann er von dem Vermieter keine Nachzahlung mehr verlangen. Vorliegend hatte der Mieter jedoch nicht einmal die vereinbarten Betriebskostenvorauszahlungen geleistet. Der BGH entschied, dass der Vermieter die vereinbarten Vorauszahlungen&nbsp;trotz der verfristeten Nebenkostenabrechnung noch verlangen kann, da der Vermieter hier keine <span style="text-decoration: underline;">Nach</span>zahlung fordert, sondern nur die vertraglich vereinbarte Vorleistung.</span></p>\r\n<p><strong><span style="font-size: small;"><span style="color: #993300;">Bundesgerichtshof, Urteil vom 31. Oktober 2007 </span></span></strong></p>\r\n<p><strong><span style="font-size: small;"><span style="color: #993300;">Aktenzeichen VIII ZR 261/06</span></span></strong></p>\r\n<p><span style="font-size: small;">Photo: eka - Fotolia.com</span></p>', 0, 2, 11, 1, '4adc6bcb0176b.com', '2009-09-23 20:16:38', '0000-00-00 00:00:00'),
(20, 'Unwirksamkeit von Endrenovierungsklauseln', '<h3><span style="color: #993300;"><span style="font-size: medium;">Unwirksamkeit von Endrenovierungsklauseln</span></span></h3>\r\n<p><strong><span style="font-size: small;">Klauseln in Mietvertr&auml;gen, die den Mieter generell zu einer Endrenovierung verpflichten &ndash; unabh&auml;ngig von dem tats&auml;chlichen Zustand der Wohnung &ndash; sind nach einer Entscheidung des Bundesgerichtshofs vom 1. September 2007 unwirksam.</span></strong></p>\r\n<p><span style="color: #993300;"><span style="font-size: small;"><strong>Endrenovierungsklauseln</strong></span></span></p>\r\n<p><span style="font-size: small;">Von der Entscheidung des BGH sind solche Klauseln in Mietvertr&auml;gen betroffen, die dem Mieter bei Auszug aus der Wohnung eine Renovierungsverpflichtung auferlegt, ohne eine Einschr&auml;nkung im Hinblick auf die tats&auml;chliche Notwendigkeit der Renovierung vorzunehmen.</span></p>\r\n<p><strong><span style="color: #993300;"><span style="font-size: small;">Unangemessene Benachteiligung</span></span></strong></p>\r\n<p><span style="font-size: small;">In vielen F&auml;llen, so meint der Bundesgerichtshof, sei es m&ouml;glich, dass kein tats&auml;chlicher Renovierungsbedarf vorliege. Dies kann zum einen gelten, wenn ein Mietverh&auml;ltnis nur kurz bestanden hat oder wenn die Wohnung kaum genutzt wurde und daher keine beeintr&auml;chtigende Abnutzung des Wohnraumes vorlag. Aber auch in den F&auml;llen, in denen ein Mieter wenige Monate vor dem Auszug Renovierungsma&szlig;nahmen durchgef&uuml;hrt hatte, liegt wohl bei Beendigung des Mietverh&auml;ltnisses kein Renovierungsbedarf vor. Wenn der Mieter dann dennoch aufgrund der strittigen Endrenovierungsklausel verpflichtet ist, Renovierungsma&szlig;nahmen durchzuf&uuml;hren, ist hierin die unangemessene Benachteiligung zu sehen, da die Ma&szlig;nahme dann wirtschaftlich nicht sinnvoll ist und der Vermieter eine Renovierung wohl nicht durchf&uuml;hren lie&szlig;e, wenn die Kostentragungspflicht auf Seiten des Vermieters l&auml;ge.</span></p>\r\n<p><strong><span style="color: #993300;"><span style="font-size: small;">Unwirksamkeit der Klausel</span></span></strong></p>\r\n<p><span style="font-size: small;">Da eine Klausel, die den Mieter generell zur Endrenovierungsverpflichtung verpflichtet, m&ouml;glicherweise den Mieter unangemessen benachteiligen kann, ist eine solche Klausel generell unwirksam. Dies gilt also auch f&uuml;r die F&auml;lle, in denen der Mieter objektiv gar nicht benachteiligt ist. Die blo&szlig;e M&ouml;glichkeit der Benachteiligung durch eine solche Klausel f&uuml;hrt dazu, dass der betroffene Mieter bei Auszug keine Endrenovierung vornehmen muss. Bereits im Hinblick auf Sch&ouml;nheitsreparaturen hatte der BGH eine &auml;hnliche Argumentation verfolgt.</span></p>\r\n<p><strong><span style="font-size: small;"><span style="color: #993300;">Bundesgerichtshof, Urteil vom 01. September 2007</span></span></strong></p>\r\n<p><strong><span style="font-size: small;"><span style="color: #993300;">Aktenzeichen VIII ZR 316/06</span></span></strong></p>\r\n<p><span style="font-size: small;">Photo: Aamon Fotolia</span></p>', 0, 2, 8, 1, '4ad5eaad99247.JPG', '2009-09-23 20:51:07', '0000-00-00 00:00:00'),
(21, 'Nachforderung bei verspätet korrigierter Betriebskostenabrechnung', '<p><strong><span style="font-size: small;"><span style="color: #993300;"><span style="font-size: medium;">Eine Nachforderung von Betriebskosten aufgrund einer nach Fristablauf ge&auml;nderten Betriebskostenabrechnung ist nicht m&ouml;glich</span></span></span></strong></p>\r\n<p><strong><span style="font-size: small;">Betriebskostenabrechnungen m&uuml;ssen gem&auml;&szlig; &sect; 556 Abs. 3 BGB sp&auml;testens 12 Monate nach dem Abrechnungszeitraum erstellt werden. Rechnet der Vermieter versp&auml;tet ab, kann er gem&auml;&szlig; der benannten gesetzlichen Vorschrift, keine Nachforderung mehr gegen den Mieter durchsetzen. Im&nbsp;Dezember 2007 entschied der Bundesgerichtshof&nbsp;&uuml;ber die Frage,&nbsp;ob eine fristgerecht erstellte Betriebskostenabrechnung noch nachtr&auml;glich korrigiert werden kann, wenn die Abrechnungsfrist&nbsp;abgelaufen ist.&nbsp;</span></strong></p>\r\n<p><strong><span style="font-size: small;"><span style="color: #993300;">Sachverhalt</span></span></strong></p>\r\n<p><span style="font-size: small;">In dem zu entscheidenden&nbsp;Fall hatte der Vermieter zun&auml;chst eine fristgerechte Betriebskostenabrechung erstellt.&nbsp;Hierbei war ein Guthaben f&uuml;r den Mieter ausgewiesen. Nach Ablauf der Abrechnungsfrist erstellte der Vermieter dann eine korrigierte Abrechung. Demnach h&auml;tte der Mieter einen Betrag nachzahlen m&uuml;ssen. </span></p>\r\n<p><strong><span style="color: #993300;"><span style="font-size: small;">Nachforderungsbetrag</span></span></strong></p>\r\n<p><span style="font-size: small;">Stellt der Vermieter&nbsp;erst nach Ablauf der Abrechnungsfrist eine korrigierte Betriebskostenabrechung und weicht diese von der fristgerecht erteilten Abrechnung ab, kann der Vermieter nach der oben genannten Entscheidung des Bundesgerichtshofs einen Nachforderungsbetrag gegen&uuml;ber dem Mieter nicht mehr geltend machen. Der Vermieter kann sich also nicht zugute halten, dass er innerhalb des Abrechungszeitraumes eine &ndash; wenn auch fehlerhafte &ndash; Abrechnung erstellt hatte.</span></p>\r\n<p><strong><span style="color: #993300;"><span style="font-size: small;">Absolute Ausschlussfrist</span></span></strong></p>\r\n<p><span style="font-size: small;">Nach der Rechtssprechung des BGH handelt es sich bei der in &sect; 556 Abs. 3 BGB festgelegten Frist, um eine absolute Ausschlussfrist zugunsten des Mieters. Dies bedeutet, dass der Vermieter an eine einmal erstellte Betriebskostenabrechnung innerhalb der Abrechnungsfrist gebunden bleibt, sobald die Abrechnungsfrist abgelaufen ist, wenn die fristgerechte Abrechnung f&uuml;r den Mieter g&uuml;nstiger ist.</span></p>\r\n<p><strong><span style="color: #993300;"><span style="font-size: small;">Kein Anspruch auf R&uuml;ckzahlung eines f&auml;lschlich ausgerechneten Guthabens</span></span></strong></p>\r\n<p><span style="font-size: small;">Selbst wenn der Vermieter in einer innerhalb der Abrechnungsfrist erstellten Betriebskostenabrechnung f&auml;lschlicherweise ein Guthaben des Mieters errechnet hatte und sich aufgrund der nach der Ablauffrist erstellten Abrechnung ein Nachzahlungsbetrag ergibt, kann der Mieter sich auf die f&uuml;r ihn g&uuml;nstigere fristgerechte Abrechnung berufen.</span></p>\r\n<p><strong><span style="color: #993300;"><span style="font-size: small;">Frist dient der Rechtssicherheit</span></span></strong></p>\r\n<p><span style="font-size: small;">Der BGH ist der Auffassung, dass die Ausschlussfrist aus &sect; 556 Abs. 3 BGB der Abrechnungssicherheit dient. Der Mieter soll sich darauf verlassen k&ouml;nnen, dass nach Ablauf der Frist,&nbsp;keine Nachforderungen auf ihn zukommen k&ouml;nnen. Dieser Zweck k&ouml;nnte jedoch nicht erreicht werden, wenn der Vermieter berechtigt w&auml;re, nach Ablauf der Frist eine&nbsp;korrigierte Betriebskostenabrechnung vorzulegen, die den&nbsp;Mieter&nbsp;schlechter&nbsp;stellt, als er nach der fristgerechten&nbsp;</span><span style="font-size: small;">Abrechnung gestanden h&auml;tte.</span></p>\r\n<p><strong><span style="font-size: small;"><span style="color: #993300;">Bundesgerichtshof Urteil vom 12. Dezember 2007, </span></span></strong></p>\r\n<p><strong><span style="font-size: small;"><span style="color: #993300;">AktenzeichenVIII ZR 190/06</span></span></strong></p>\r\n<p><span style="font-size: small;">Photo: Fineas Fotolia</span></p>', 0, 2, 11, 1, '4ad5e9fdaccb3.JPG', '2009-09-23 20:58:49', '0000-00-00 00:00:00'),
(29, 'Zum Ersatz von Sachverständigenkosten', '<p><strong><span style="color: #ff0000;"><span style="font-size: medium;"><span style="color: #993300;">Zum Ersatz von Sachverst&auml;ndigenkosten bei sogenannten Bagatellsch&auml;den</span> </span></span></strong></p>\r\n<p><strong><span style="font-size: small;">Ob die Kosten eines Sachverst&auml;ndigengutachtens zum erforderlichen Wiederherstellungsaufwand geh&ouml;ren und vom Sch&auml;diger auch dann zu ersetzen sind, wenn es sich um einen Bagatellschaden handelt, entschied der Bundesgerichtshof in einem Urteil vom 30. November 2004. Hierbei nahm er auch zu der Frage Stellung, unterhalb welchen Schadenbetrages es sich um einen Bagatellschaden handeln k&ouml;nnte. </span></strong></p>\r\n<p><span style="color: #ff0000;"><strong><span style="color: #993300;"><span style="font-size: small;">&nbsp;</span></span></strong></span></p>\r\n<p><span style="color: #ff0000;"><strong><span style="color: #993300;"><span style="font-size: small;">Erstattungsf&auml;higkeit von Sachverst&auml;ndigenkosten</span></span></strong></span></p>\r\n<p><span style="font-size: small;">Die Kosten eines Sachverst&auml;ndigengutachtens geh&ouml;ren nach Auffassung des Bundesgerichtshofs zu den mit dem Schaden unmittelbar verbundenen auszugleichenden Verm&ouml;gensnachteilen. Voraussetzung ist jedoch, dass die Begutachtung zur tats&auml;chlichen Wiederherstellung erforderlich und zweckm&auml;&szlig;ig sei.</span></p>\r\n<p><span style="color: #ff0000;"><strong><span style="color: #993300;"><span style="font-size: small;">Erforderlichkeit einer Begutachtung</span></span></strong></span></p>\r\n<p><span style="font-size: small;">Generell sind die Kosten der Sachverst&auml;ndigen zu ersetzen, wenn ein verst&auml;ndiger und wirtschaftlich denkender Gesch&auml;digte nach seinen Erkenntnissen und M&ouml;glichkeiten die Einschaltung eines Sachverst&auml;ndigen f&uuml;r geboten erachten durfte. Hierbei kann nicht alleine auf das Verh&auml;ltnis der Sachverst&auml;ndigenkosten zu dem ermittelten Schaden geachtet werden. Zu ber&uuml;cksichtigen ist, dass der Gesch&auml;digte zu dem Zeitpunkt der Beauftragung des Gutachters grade die noch zu ermittelnde Schadensh&ouml;he nicht kennt. Allerdings k&ouml;nne der sp&auml;ter ermittelte Schadenumfang ein Anhaltspunkt daf&uuml;r darstellen, ob der Gesch&auml;digte bei der Beaufragung des Gutachters nicht erkennen musste, dass m&ouml;glicherweise eine andere, kosteng&uuml;nstigere Sch&auml;tzung (z. B. Kostenvoranschlag) ausreichend gewesen w&auml;re.</span></p>\r\n<p><span style="color: #ff0000;"><strong><span style="color: #993300;"><span style="font-size: small;"><strong><span style="font-size: xx-small;"><span style="color: #ff0000;"><strong><span style="color: #993300;"><span style="font-size: small;">Bagatellschaden</span></span></strong></span></span></strong></span></span></strong></span></p>\r\n<p><span style="font-size: small;">In dem vorliegenden Fall lag der Schaden &uuml;ber 715 &euro; und der Bundesgerichtshof ging davon aus, dass bei dieser Schadenh&ouml;he nicht von einem Bagatellschaden auszugehen sei.</span></p>\r\n<p><strong><span style="font-size: small;"><span style="color: #993300;">Bundesgerichtshof, Urteil vom 30. November 2004 </span></span></strong></p>\r\n<p><strong><span style="font-size: small;"><span style="color: #993300;">Aktenzeichen VI ZR 365/03</span></span></strong></p>\r\n<p><span style="font-size: small;">Photo: Dron - Fotolia.com</span></p>', 0, 4, 50, 1, '4adca09b6f7f6.com', '2009-09-29 08:31:49', '0000-00-00 00:00:00'),
(30, 'Nutzungsausfallentschädigung bei älteren Fahrzeugen', '<p><strong><span style="color: #993300;"><span style="font-size: medium;">Zur Bemessung der Nutzungsausfallentsch&auml;digung bei einem &auml;lteren Kraftfahrzeug</span></span></strong></p>\r\n<p><strong><span style="font-size: small;">In seiner Entscheidung vom 25. Januar 2005 befasste sich der Bundesgerichtshof mit der Frage, ob eine Nutzungsausfallentsch&auml;digung auch beansprucht werden kann, wenn das Fahrzeug des Gesch&auml;digten schon &auml;lter war und sich das Fahrzeug mit diesem Baujahr in den einschl&auml;gigen Tabellen nicht mehr findet. Des Weiteren setzte sich der BGH mit der H&ouml;he einer etwaigen Nutzungsausfallentsch&auml;digung auseinander.</span></strong></p>\r\n<p><strong><span style="color: #993300;"><span style="font-size: small;">Anspruch aus Nutzungsausfallentsch&auml;digung</span></span></strong></p>\r\n<p><span style="font-size: small;">Der Bundesgerichtshof blieb bei seiner Auffassung aus fr&uuml;heren Entscheidungen, dass grunds&auml;tzlich auch bei &auml;lteren Fahrzeugen ein Anspruch auf Nutzungsentsch&auml;digung bestehe. Demgem&auml;&szlig; bleibt es bei dem Rechtsgrundsatz, dass ein Fahrzeug unabh&auml;ngig von seinem Alter stets einen Nutzungswert beh&auml;lt und dieser gegen&uuml;ber einem neueren Fahrzeug lediglich herabgesetzt sein kann, jedoch nicht ganz aufgehoben wird.</span></p>\r\n<p><strong><span style="color: #993300;"><span style="font-size: small;">Dauer des Anspruchs</span></span></strong></p>\r\n<p><span style="font-size: small;">Die H&ouml;he der Nutzungsausfallentsch&auml;digung k&ouml;nne auch bei einer l&auml;ngeren Ausfallzeit nicht schematisch durch den Wert des Fahrzeuges begrenzt werden. In dem zu entscheidenden Fall war der Wiederbeschaffungswert des Fahrzeuges von dem Sachverst&auml;ndigen auf 2.812,11 &euro; gesch&auml;tzt worden. Zugesprochen waren dem Gesch&auml;digten dann letztendlich eine Nutzungsausfallentsch&auml;digung in H&ouml;he von 7.175,47 &euro;. Das Gericht vertrat die Auffassung, dass auch eine l&auml;ngere Ausfallzeit keinen Einfluss auf die H&ouml;he des Nutzungsausfalls haben k&ouml;nne, wenn die lange Ausfalldauer von dem Gesch&auml;digten nicht zu verantworten sei.</span></p>\r\n<p><strong><span style="color: #993300;"><span style="font-size: small;">H&ouml;he der Nutzungsausfallentsch&auml;digung</span></span></strong></p>\r\n<p><span style="font-size: small;">Ein Gericht darf im Rahmen der Schadensch&auml;tzung auch bei &auml;lteren Fahrzeugen auf die in der Praxis anerkannten Tabellen (Sander/Danner/K&uuml;ppersbusch) zugrunde legen. Da der Nutzungswert eines &auml;lteren Fahrzeuges in der Regel gegen&uuml;ber demjenigen eines neueren Fahrzeuges aufgrund der Fortentwicklung der Fahrzeugtechnik geringer sei, k&ouml;nne dem Rechnung getragen werden, in dem das Fahrzeug in der Tabellengruppierung um eine Stufe herabgesetzt werde.</span></p>\r\n<p><strong><span style="color: #993300;"><span style="font-size: small;">Bundesgerichtshof, Urteil vom 25. Januar 2005&nbsp;</span></span></strong></p>\r\n<p><strong><span style="color: #993300;"><span style="font-size: small;">Aktenzeichen VI ZR 112/04</span></span></strong></p>\r\n<p><span style="font-size: small;">Photo: Fantasista - Fotolia.com&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>&nbsp;</p>', 0, 4, 51, 1, '4adca0501b6b4.com', '2009-09-29 08:51:00', '0000-00-00 00:00:00'),
(31, 'Vertragsstrafe', '<p><strong><span style="font-size: small;"><span style="color: #993300;"><span style="font-size: medium;">Die Vereinbarung einer Vertragsstrafe in einem Arbeitsvertrag ist generell zul&auml;ssig </span></span></span></strong></p>\r\n<p><strong><span style="font-size: small;">In einer Entscheidung aus M&auml;rz 2004 hat sich das Bundesarbeitsgericht&nbsp;zum wiederholten Male&nbsp;mit der Frage&nbsp;auseinander gesetzt, ob eine Vertragsstrafe in einem Arbeitsvertrag zul&auml;ssig ist. Neben der Frage der Zul&auml;ssigkeit ging es bei dem behandelten Fall auch um die Kl&auml;rung des Streitpunktes, in welcher H&ouml;he eine etwaige Vertragsstrafe festgelegt werden kann. </span></strong></p>\r\n<p><strong><span style="color: #993300;"><span style="font-size: small;">&nbsp;</span></span></strong></p>\r\n<p><strong><span style="color: #993300;"><span style="font-size: small;">Vereinbarung einer Vertragsstrafe</span></span></strong></p>\r\n<p><span style="font-size: small;">Das Bundesarbeitsgericht (BAG) stellte noch einmal klar, dass die Vereinbarung einer Vertragsstrafe in einem Arbeitsvertrag generell m&ouml;glich sei. Dem Arbeitgeber st&uuml;nde sonst keine Ma&szlig;nahme zur Verf&uuml;gung, den Arbeitnehmer zur Erbringung seiner Arbeitsleistung anzuhalten.</span></p>\r\n<p><strong><span style="color: #993300;"><span style="font-size: small;">Verh&auml;ltnism&auml;&szlig;igkeit der Vertragsstrafe</span></span></strong></p>\r\n<p><span style="font-size: small;">Zu beachten sei jedoch, dass die vereinbarte Vertragsstrafe den Mitarbeiter nicht unangemessen benachteilige - es also zu keiner &Uuml;bertreibung bei der H&ouml;he der veranschlagten Vertragsstrafe kommen d&uuml;rfe. Im Falle einer unangemessenen Benachteiligung sei die Vertragsstrafenregelung insgesamt unwirksam und dem Arbeitgeber st&uuml;nde in diesem Fall keinerlei Zahlung zu.</span></p>\r\n<p><strong><span style="color: #993300;"><span style="font-size: small;">H&ouml;he der Vertragsstrafe</span></span></strong></p>\r\n<p><span style="font-size: small;">In dem behandelten Fall hatte eine Verk&auml;uferin ihre Arbeitsstelle nicht angetreten. F&uuml;r diesen Fall war sie gem&auml;&szlig; dem zugrunde liegenden Arbeitsvertrag verpflichtet, eine Vertragsstrafe in H&ouml;he von einem Bruttomonatslohn&nbsp;an den Arbeitgeber als Vertragsstrafe zu leisten. Das Bundesarbeitsgericht sah die H&ouml;he der Vertragsstrafe als unangemessen an, da die K&uuml;ndigungsfrist in der zwischen den Parteien vereinbarten Probezeit lediglich zwei Wochen betragen habe.&nbsp;Der Arbeitgeber h&auml;tte&nbsp;in diesem Fall&nbsp;also bei einer ordentlichen K&uuml;ndigung w&auml;hrend der Probezeit, maximal einen Anspruch auf eine zwei w&ouml;chige Arbeitsleistung gehabt. Das BAG&nbsp;legte fest, dass der Arbeitnehmer&nbsp;dann unangemessen benachteiligt sei, wenn die Vertragsstrafe &uuml;ber dem vereinbarten Wert der Arbeitsleistung liege, die der Arbeitgeber bei einer ordentlichen K&uuml;ndigung beanspuchen k&ouml;nne.</span></p>\r\n<p><strong><span style="color: #993300;"><span style="font-size: small;">Ergebnis</span></span></strong></p>\r\n<p><span style="font-size: small;">Hieraus folgt, dass&nbsp;eine vereinbarte&nbsp;Vertragsstrafe nicht h&ouml;her liegen darf, als die Arbeitsverg&uuml;tung, die der Mitarbeiter innerhalb der jeweiligen K&uuml;ndigungsfrist h&auml;tte beziehen k&ouml;nnen.</span></p>\r\n<p><strong><span style="font-size: small;"><span style="color: #993300;">Bundesarbeitsgericht, Urteil vom 4. M&auml;rz 2004 </span></span></strong></p>\r\n<p><strong><span style="font-size: small;"><span style="color: #993300;">Aktenzeichen&nbsp;8 AZR 196/03</span></span></strong></p>\r\n<p><span style="font-size: small;">Photo: Forgiss - Fotolia.com&nbsp;<strong>&nbsp;</strong>&nbsp;&nbsp;</span></p>', 0, 6, 52, 1, '4adc9b762512f.com', '2009-09-29 08:54:01', '0000-00-00 00:00:00'),
(34, 'Klausel zur pauschalen Abgeltung von Überstunden ist unwirksam', '<p><strong><span style="color: #993300;"><span style="font-size: medium;">Klausel zur pauschalen Abgeltung von &Uuml;berstunden ist unwirksam</span></span></strong></p>\r\n<p><strong><span style="font-size: small;">Nach einem Urteil des LAG D&uuml;sseldorf ist eine Klausel in einem Arbeitsvertrag nach der pauschal alle &Uuml;berstunden mit der vereinbarten Monatsverg&uuml;tung abgegolten sein sollen, unwirksam. Eine solche Abgeltungsklausel benachteilige den Arbeitnehmer unangemessen.</span></strong></p>\r\n<p><strong><span style="color: #993300;"><span style="font-size: small;">Klausel</span></span></strong></p>\r\n<p><span style="font-size: small;">In einem vorformulierten Arbeitsvertrag hatten die Parteien vereinbart, dass alle geleisteten &Uuml;berstunden mit dem Bruttomonatsgehalt abgegolten sein sollten. Begrenzt wurde die Anzahl der &Uuml;berstunden lediglich durch einen Verweis auf das Arbeitszeitgesetz bzw. der tariflichen Bestimmungen. Demnach sollte nur die Mehrarbeit durch den Monatslohn mit abgegolten sein, die gem&auml;&szlig; dem Arbeitszeitgesetz zul&auml;ssig war.</span></p>\r\n<p><strong><span style="font-size: small;"><span style="color: #993300;">Unangemessene Benachteiligung</span> </span></strong></p>\r\n<p><span style="font-size: small;">Das Landesarbeitsgericht D&uuml;sseldorf sah in dieser Formulierung eine unangemessene Benachteiligung des Arbeitnehmers, da im Arbeitsvertrag nicht angegeben sei, mit wie viel mehr Arbeitstunden der Arbeitnehmer zu rechnen habe. So k&ouml;nne er jedoch nicht erkennen, welche Gegenleistung er insgesamt f&uuml;r den vereinbarten Monatslohn zu leisten habe und er k&ouml;nne somit auch nicht errechnen, welchen Stundenlohn er erhalte.</span></p>\r\n<p><strong><span style="color: #993300;"><span style="font-size: small;">Folgen der Unwirksamkeit</span></span></strong></p>\r\n<p><span style="font-size: small;">Da die vertragliche Bestimmung unwirksam war, richtete sich der Inhalt des Vertrages nach den gesetzlichen Vorschriften. Demnach gilt eine Verg&uuml;tung als stillschweigend vereinbart, wenn die Dienstleistung den Umst&auml;nden nach nur gegen eine Verg&uuml;tung zu erwarten ist (&sect; 612 BGB). Vereinbart gilt in solchen F&auml;llen dann eine &uuml;bliche Verg&uuml;tung. Die H&ouml;he richtet sich also regelm&auml;&szlig;ig nach dem vereinbarten Monatslohn, umgerechnet auf die Regelarbeitszeit.</span></p>\r\n<p><strong><span style="color: #993300;"><span style="font-size: small;">Landesarbeitsgericht D&uuml;sseldorf, Urteil vom 11 Juli 2008 </span></span></strong></p>\r\n<p><strong><span style="color: #993300;"><span style="font-size: small;">Aktenzeichen&nbsp;9 Sa 1958/07</span></span></strong></p>\r\n<p><span style="font-size: small;">Photo: plrang -&nbsp;Fotolia.com&nbsp;</span></p>', 0, 6, 52, 1, '4adc9c6b56f09.com', '2009-10-14 14:36:36', '0000-00-00 00:00:00'),
(35, 'Übergabe einer Kopie der Kündigung ist nicht ausreichend', '<p><strong><span style="color: #993300;"><span style="font-size: medium;">&Uuml;bergabe einer Kopie der K&uuml;ndigung ist nicht ausreichend</span></span></strong></p>\r\n<p><span style="font-size: small;"><strong>In einem Urteil aus April 2007 entschied das Landesarbeitsgericht D&uuml;sseldorf, dass es nicht ausreichend ist, wenn ein Arbeitsgeber ein Arbeitsverh&auml;ltnis k&uuml;ndigt und dem </strong><strong>Arbeitnehmer lediglich eine Kopie des K&uuml;ndigungsschreibens &uuml;berl&auml;sst.</strong></span></p>\r\n<p><strong><span style="color: #993300;"><span style="font-size: small;">Sachverhalt</span></span></strong></p>\r\n<p><span style="font-size: small;">Der Arbeitgeber beschloss nach einem Brandschaden einen Betriebsstandort zu schlie&szlig;en und sprach einem Arbeitnehmer gegen&uuml;ber die K&uuml;ndigung des Arbeitsverh&auml;ltnisses aus betriebsbedingten Gr&uuml;nden aus. Hierbei legte der Arbeitgeber dem Arbeitnehmer die Originalk&uuml;ndigung vor, h&auml;ndigte dem Arbeitnehmer jedoch lediglich eine Kopie des K&uuml;ndigungsschreibens aus.</span></p>\r\n<p><strong><span style="color: #993300;"><span style="font-size: small;">Rechtsgrundlagen</span></span></strong></p>\r\n<p><span style="font-size: small;">Das Landesarbeitsgericht D&uuml;sseldorf vertrat in seinem Urteil die Auffassung, dass ein K&uuml;ndigungsschreiben nicht nur eigenh&auml;ndig unterschrieben sein m&uuml;sse, sondern auch dem K&uuml;ndigungsempf&auml;nger in dieser Form auszuh&auml;ndigen sei. Gem&auml;&szlig; &sect; 623 BGB ist f&uuml;r die K&uuml;ndigung von Arbeitsverh&auml;ltnissen die Schriftform vorgeschrieben. Diese muss dem K&uuml;ndigungsempf&auml;nger als einseitig empfangsbed&uuml;rftige Willenserkl&auml;rung auch tats&auml;chlich zugehen. Das &Uuml;berreichen einer Fotokopie erf&uuml;llt also die gesetzlichen Voraussetzungen nicht.</span></p>\r\n<p><strong><span style="color: #993300;"><span style="font-size: small;">Rechtsfolgen</span></span></strong></p>\r\n<p><span style="font-size: small;">Die Unwirksamkeit der K&uuml;ndigung f&uuml;hrt dazu, dass das Arbeitsverh&auml;ltnis weiter Bestand hat. In einem solchen Fall, kann der Arbeitnehmer unter Umst&auml;nden einen Verg&uuml;tungsanspruch f&uuml;r die Zeit haben, in dem der Rechtsstreit gef&uuml;hrt wurde, selbst wenn er in dieser Zeit&nbsp;nicht besch&auml;ftigt war.</span></p>\r\n<p><strong><span style="color: #993300;"><span style="font-size: small;">Landesarbeitsgericht D&uuml;sseldorf, Urteil vom 18. April 2007&nbsp;</span></span></strong></p>\r\n<p><strong><span style="color: #993300;"><span style="font-size: small;">Aktenzeichen&nbsp;12 Sa 132/07</span></span></strong></p>\r\n<p><span style="font-size: small;">Photo: Ramona Heim - Fotolia.com&nbsp;&nbsp;&nbsp;</span></p>', 0, 6, 53, 1, '4adc9edc23ae2.com', '2009-10-14 14:46:49', '0000-00-00 00:00:00');
INSERT INTO `artikel` (`id`, `titel`, `content`, `status`, `kat_id`, `ukat_id`, `premium`, `bild_name`, `date_created`, `date_modified`) VALUES
(36, 'Urlaubsanspruch trotz dauerhafter Krankschreibung', '<p><strong><span style="font-size: small;"><span style="color: #993300;"><span style="font-size: medium;">Urlaubsanspruch trotz dauerhafter Krankschreibung</span></span></span></strong></p>\r\n<p><strong><span style="font-size: small;">Eine EU-Richtlinie regelt f&uuml;r alle Mitgliedsstaaten der EU, dass diese verpflichtet sind, bestimmte Mindestanforderungen zur Arbeitszeit und zur Urlaubsgew&auml;hrung in der jeweiligen nationalen Gesetzgebung zu implementieren. Der Europ&auml;ische Gerichtshof (EuGH) ist u. a. f&uuml;r die rechtliche Auslegung der EU-Richtlinien zust&auml;ndig. In einem Rechtsstreit legte das Landesarbeitsgericht D&uuml;sseldorf daher einen Fall dem EuGH&nbsp;&nbsp;zur Auslegung der europarechtlichen Urlaubsregelung&nbsp;(Artikel 7 der EG-Richtlinie 2003/88) vor. Der EuGH entschied, dass ein Arbeitnehmer seinen Anspruch auf bezahlten Jahresurlaub nicht deshalb verliert, weil er wegen Krankheit diesen nicht nehmen konnte. </span></strong></p>\r\n<p><strong><span style="color: #993300;"><span style="font-size: small;">Sachverhalt</span></span></strong></p>\r\n<p><span style="font-size: small;">Ein Arbeitnehmer war von September 2004 bis September 2005 durchgehend arbeitsunf&auml;hig und schied im Anschluss daran wegen voller Erwerbsminderung aus dem Arbeitsverh&auml;ltnis aus. Der Arbeitnehmer verlangte mit seiner Klage die Abgeltung des noch offenen Jahresurlaubs. Der Arbeitgeber vertrat die Ansicht, dass ein Urlaubsanspruch nicht&nbsp;in der&nbsp;Zeitspanne entstehen k&ouml;nne, in der der Arbeitnehmer seine Arbeitskraft in Folge&nbsp;einer Erkrankung nicht zur Verf&uuml;gung gestellt habe.</span></p>\r\n<p><strong><span style="color: #993300;"><span style="font-size: small;">Entscheidung des Landesarbeitsgericht D&uuml;sseldorf</span></span></strong></p>\r\n<p><span style="font-size: small;">Nachdem der Europ&auml;ische Gerichtshof entschieden hatte, dass ein Arbeitnehmer seinen Anspruch auf bezahlten Jahresurlaub nicht verliert, wenn er diesen lediglich wegen Krankheit nicht nehmen konnte, hat sich auch das LAG D&uuml;sseldorf dieser Rechtsauffassung angeschlossen, soweit es um den <span style="text-decoration: underline;">gesetzlichen Mindestanspruch</span> auf Urlaubsgew&auml;hrung geht. Demnach gilt, dass der gesetzliche Anspruch auf Erholungsurlaub von j&auml;hrlich 4 Wochen (gem. &sect; 3 BUrlG) zu Grunde zu legen ist. Der gesetzliche Erholungsurlaub werde nicht nur f&uuml;r die Zeiten erworben, in denen der Arbeitnehmer seine Arbeitskraft zur Verf&uuml;gung gestellt habe, sondern auch f&uuml;r Zeiten, in denen er ordnungsgem&auml;&szlig; krankgeschrieben sei.</span></p>\r\n<p><span style="font-size: small;">Daher verfalle der gesetzliche Anspruch auf Erholungsurlaub nicht und sei vom Arbeitgeber zu sp&auml;terer Zeit nachzugew&auml;hren. K&ouml;nne der gesetzliche Erholungsurlaub nicht nachgew&auml;hrt werden, weil das Arbeitsverh&auml;ltnis in der Zwischenzeit beendet sei, k&ouml;nne der Arbeitnehmer einen Anspruch auf Abgeltung des noch offenen Urlaubs haben. Eine andere Betrachtung ergibt sich demnach f&uuml;r einen etwaigen Urlaubsanspruch, der &uuml;ber die gesetzlichen Mindesanforderungen hinausgeht.</span></p>\r\n<p><strong><span style="font-size: small;"><span style="color: #993300;">Landesarbeitsgericht D&uuml;sseldorf, Urteil vom 24. M&auml;rz 2009 </span></span></strong></p>\r\n<p><strong><span style="font-size: small;"><span style="color: #993300;">Aktenzeichen&nbsp;12 Sa 486/06</span></span></strong></p>\r\n<p><span style="font-size: small;">Photo: Aamon - Fotolia.com</span></p>', 0, 6, 54, 1, '4adc9e992a542.com', '2009-10-14 14:54:39', '0000-00-00 00:00:00'),
(108, 'Kündigungsverzichtserklärung - vertragliche Abfindungsregelung vor gesetzlichem Anspruch', '<p><span style="font-size: medium;"><strong><span style="color: #993300;">Abfindungsanspruch des Arbeitnehmers bei einer vertraglichen Regelung</span></strong></span></p>\r\n<p><span style="font-size: small;"><strong>Gem&auml;&szlig; &sect; 1 a KSchG kann der Arbeitgeber im Falle einer K&uuml;ndigung dem Arbeitnehmer mit der K&uuml;ndigung eine Abfindung f&uuml;r den Fall anbieten, dass der Arbeitnehmer auf eine K&uuml;ndigungsschutzklage verzichtet. Die H&ouml;he der Abfindung betr&auml;gt nach der gesetzlichen Regelung 0,5 Monatsbruttogeh&auml;lter pro Besch&auml;ftigungsjahr (Zeitr&auml;ume von mehr als sechs Monaten sind aufzurunden). Das Bundesarbeitsgericht hatte in einem Fall die Frage zu entscheiden, ob der Arbeitnehmer einen Anspruch auf die gesetzliche Abfindung hat, wenn der Arbeitgeber in dem K&uuml;ndigungsschreiben einen geringeren Abfindungsanspruch ausgelobt hatte.</strong></span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #993300;">Sachverhalt</span></strong></span></p>\r\n<p><span style="font-size: small;">Der Arbeitgeber hatte dem Arbeitnehmer eine &Auml;nderungsk&uuml;ndigung ausgesprochen und f&uuml;r den Fall, dass der Arbeitnehmer den ge&auml;nderten Arbeitsbedingungen nicht zustimmt, jedoch auch keine K&uuml;ndigungsschutzklage erhebt, eine Abfindung gem&auml;&szlig; eines dem Arbeitnehmer bekannten Sozialplanes angeboten. Diese Abfindung betrug im Falle des Arbeitnehmers 6.000,00 &euro;. Nach der gesetzlichen Regelung h&auml;tte dem Arbeitnehmer eine Abfindung in H&ouml;he von ca. 13.000,00 &euro; zugestanden. Der Arbeitnehmer stimmte den ge&auml;nderten Arbeitsbedingungen nicht zu und lies auch die Frist zur Einlegung der K&uuml;ndigungsschutzklage verstreichen. Dann klagte der Arbeitnehmer auf Zahlung der ca. 7.000,00 &euro; Differenz, zwischen der von dem Arbeitgeber ausgezahlten Abfindung und der Abfindung, die bei Anwendung der gesetzlichen Regelung zu zahlen gewesen w&auml;re.</span></p>\r\n<p><span style="font-size: small;"><span style="color: #993300;"><strong>Vorrang der vertraglichen Regelung</strong></span></span></p>\r\n<p><span style="font-size: small;">Der Arbeitnehmer vertrat die Rechtsauffassung, die gesetzliche Regelung stelle einen Mindestabfindungsanspruch dar, der nicht durch eine vertragliche Regelung aufgehoben werden k&ouml;nne. Wenn es um den Verzicht auf eine K&uuml;ndigungsschutzklage gem&auml;&szlig; &sect; 1 a KSchG gehe, m&uuml;sse die dort&nbsp;gesetzlich vorgesehene Abfindung als Mindesma&szlig; angenommen werden. Dem widersprach das Bundesarbeitsgericht. Nicht jedes Angebot auf Zahlung einer Abfindung im Falle des Verzichts auf eine K&uuml;ndigungsschutzklage f&uuml;hre zu der vom Gesetzgeber vorgesehenen H&ouml;he der Abfindung. Die Parteien seien frei, h&ouml;here oder niedrigere Abfindungszahlungen auszuhandeln. In dem zu beurteilenden Fall habe der Arbeitgeber f&uuml;r den Arbeitnehmer erkennbar ein Angebot unterbreitet, das unter der gesetzlichen Vorgabe lag. Dem Arbeitnehmer stand es daher frei, auf eine K&uuml;ndigungsschutzklage zu diesen Bedingungen zu verzichten oder die ausgelobte Abfindung anzunehmen.</span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #993300;">Bundesarbeitsgericht, Urteil vom 13. Dezember 2007</span></strong></span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #993300;">Aktenzeichen: 2 AZR 663/06</span></strong></span></p>\r\n<p><span style="font-size: small;"><span style="color: #000000;">Photo: Michele Lorenzini - Fotolia.com</span></span></p>', 0, 6, 53, 1, '4aeffded95a56.com', '2009-11-02 18:54:42', '0000-00-00 00:00:00'),
(121, 'Eigene Mahnkosten - erstattungsfähig?', '<p><strong><span style="font-size: medium;"><span style="color: #993300;">Zur Erstattungsf&auml;higkeit eigener Mahnkosten</span></span></strong></p>\r\n<p><strong><span style="font-size: small;">H&auml;ufig werden von Unternehmen bei einer Mahnung Kosten f&uuml;r die Mahnung erhoben. Dies ist weit ge&uuml;bte Praxis. Gleichwohl stellt sich die Frage der Rechtm&auml;&szlig;igkeit einer Forderung von (eigenen) Mahnkosten.</span></strong></p>\r\n<p><strong><span style="font-size: small;"><span style="color: #993300;">Verzugsschaden</span></span></strong></p>\r\n<p><span style="font-size: small;">W&auml;hrend des Verzugs hat der Schuldner dem Gl&auml;ubiger den Schaden zu ersetzen, der dem Gl&auml;ubiger infolge des Verzuges entsteht&nbsp;(&sect;&sect; 280 Abs. 1 und 2 i. V. m. &sect;&nbsp;286 BGB). Hierauf kann sich der Gl&auml;ubiger&nbsp;st&uuml;tzen, wenn er von dem Schuldner u. a. die Erstattung&nbsp;von aufgewendeten Anwaltskosten verlangt.&nbsp;Es stellt sich daher die Frage, ob diese Vorschrift auch bei&nbsp;einem Anspruch auf Erstattung von eigenen Kosten&nbsp;f&uuml;r die Erstellung einer&nbsp;Mahnung herangezogen werden k&ouml;nnte.</span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #993300;">Erstmahnung</span></strong></span></p>\r\n<p><span style="font-size: small;">H&auml;ufig werden gestaffelte Mahngeb&uuml;hren von dem Gl&auml;ubiger f&uuml;r die Erstellung der Mahnung gefordert. Dabei werden pauschale Betr&auml;ge&nbsp;in H&ouml;he von z. B.&nbsp;10,00 &euro; f&uuml;r die erste Mahnung gefordert. Im Regelfall beginnt der Verzug jedoch erst mit dem Zugang&nbsp;der ersten Mahnung bei dem Schuldner (etwas anderes gilt, wenn der Verzug aufgrund von Zeitablauf eintritt). In diesen F&auml;llen kann ein Verzugsschaden also noch nicht vorliegen, was zur Folge hat, dass bei der den Verzug begr&uuml;ndeten Erstmahnung ein Erstattungsanspruch f&uuml;r etwaige dem Gl&auml;ubiger entstandener Kosten nicht entsteht.</span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #993300;">Schaden</span></strong></span></p>\r\n<p><span style="font-size: small;">Dar&uuml;ber hinaus gilt, dass der Gl&auml;ubiger von dem Schuldner nur den tats&auml;chlich entstandenen Schaden ersetzt verlangen kann. Dies ist bei einer Mahnung das Porto f&uuml;r die Versendung, der Briefumschlag&nbsp;und das Briefpapier. Die Gerichte lassen es hier auch durchaus zu, dass der Schaden pauschal mit einer angemessenen Summe genannt wird. Im Regelfall werden hier 2,50 &euro; anerkannt. Ein dar&uuml;ber hinaus gehender Schaden&nbsp;f&uuml;r den Zeitaufwand des Gl&auml;ubigers ist jedoch nicht erstattungsf&auml;hig (vgl. BGH Urteil vom 09.03.1976 - VI ZR 98/75).&nbsp;</span></p>\r\n<p><span style="font-size: small;">Photo: Fineas - Fotolia.com&nbsp;</span></p>', 0, 1, 67, 1, '4af9b32683363.com', '2009-11-10 18:38:30', '0000-00-00 00:00:00'),
(118, 'Abmahnkosten bei fehlerhafter Widerrufsbelehrung', '<p><strong><span style="font-size: medium;"><span style="color: #993300;">OLG D&uuml;sseldorf begrenzt den Streitwert&nbsp;bei Abmahnungen wegen fehlerhafter Widerrufsbelehrung</span></span></strong></p>\r\n<p><strong><span style="font-size: small;">F&uuml;r viele Anwaltskanzleien ist es ein lukratives Gesch&auml;ft: Abmahnungen! Hierbei ist vor allem der Online-Handel ein lohnenswertes Ziel. Massenhaft k&ouml;nnen hier H&auml;ndlerangebote im Hinblick auf eine rechtsfehlerfreie Widerrufsbelehrung gepr&uuml;ft werden. Da die Widerrufsbelehrung viele rechtliche Fallstricke aufweist, findet man hier mit relativ wenig Aufwand "rechtswidrige" Belehrungen.</span></strong></p>\r\n<p><strong><span style="font-size: small;"><span style="color: #993300;">Streitwert</span></span></strong></p>\r\n<p><span style="font-size: small;">Der Streitwert einer solchen Abmahnung muss nach dem freien Ermessen des Gerichtes (gem. &sect; 63 Abs. 2 GKG) festgesetzt werden. In der Vergangenheit wurden Streitwerte von bis zu 15.000,00 &euro; und mehr festgesetzt. Diese Praxis ist auch heute noch bei einigen Gerichten vorzufinden. F&uuml;r den abmahnenden Anwalt ist die Festsetzung eines m&ouml;glichst hohen Streitwertes wichtig, da sich die Anwaltsgeb&uuml;hren hieraus berechnen (ebenso wie die Gerichtskosten). F&uuml;r den abgemahnten H&auml;ndler bedeutet ein hoher Streitwert folglich, dass die Kosten des Rechtsstreits f&uuml;r die er im Falle des Unterliegens aufkommen muss, besonders hoch ausfallen.</span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #993300;">Kritik</span></strong></span></p>\r\n<p><span style="font-size: small;">Die beschriebene Praxis ist in der Vergangenheit heftiger Kritik ausgesetzt gewesen. Zum einen argumentieren viele H&auml;ndler, dass die H&ouml;he des Kostenrisikos f&uuml;r sie in keinem Verh&auml;ltnis zu dem Verkaufserl&ouml;s stehe, den sie mit ihrem (in der Regel) kleinen Online-Shop erwirtschaften k&ouml;nnen. Auch sei es f&uuml;r einen kleinen H&auml;ndler viel zu schwierig geworden, alle rechtlichen Vorschriften einzuhalten. Des weitern f&uuml;hlen sich viele H&auml;ndler von professionellen Abmahnanw&auml;lten regelrecht verfolgt. Schlie&szlig;lich seien die gesetzlichen Regelungen zum Schutz des Verbrauchers&nbsp;eingef&uuml;hrt worden und nicht zur Verm&ouml;gensvermehrung von Anw&auml;lten.</span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #993300;">Entscheidungen des OLG D&uuml;sseldorf</span></strong></span></p>\r\n<p><span style="font-size: small;">Zumindest im Ergebnis erhalten die Kritiker Unterst&uuml;tzung vom Oberlandesgericht D&uuml;sseldorf. In mehreren F&auml;llen haben die Richter dort entschieden, dass sich der Streitwert einer Abmahnung wegen einer fehlerhaften Widerrufsbelehrung an dem wirtschaftlichen&nbsp;Interesse des Antragstellers orientieren muss. Dieses wirtschaftliche Interesse sei jedoch bei einer fehlerhaften Widerrufsbelehrung eher als gering einzustufen. Der fraglos vorhandene Wettbewerbsvorsprung sei nur in sehr geringem Ma&szlig; gegeben, da bei der F&uuml;lle der im Internet angebotenen Waren, es eher selten vorkommen d&uuml;rfte, dass ein Kaufinteressent sich wegen einer fehlerhaften Belehrung f&uuml;r das Produkt des Antragsgegners, statt f&uuml;r jenes des Antragstellers entscheidet (vgl. OLG D&uuml;sseldorf Beschluss vom 05.07.07 - I-20 W 15/07 -; Beschluss vom 29.11.07 - I-20 U 107/07 -; Beschluss vom 19.04.07 - I-20 W 13/07 -; vom Prinzip ebenso, jedoch wegen Besonderheiten h&ouml;herer Steitwert: Urteil vom 15.04.08 - I-20 U 187/07 -). In den benannten Entscheidungen hatte das OLG D&uuml;sseldorf daher den Streitwert auf 900,00 &euro; festgesetzt.</span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #993300;">Weitere Entscheidungen</span></strong></span></p>\r\n<p><span style="font-size: small;">Ob mit der Entscheidungspraxis des Oberlandesgericht D&uuml;sseldorf eine Trendwende eingeleitet wird, darf in Frage gestellt werden. Das OLG Hamm hatte noch in einem Urteil vom 15.04.09 den Streitwert f&uuml;r eine fehlerhafte Widerrufsbelehrung auf 15.000,00 &euro; festgesetzt (vgl. OLG Hamm, Urteil vom 14.05.09 - 4 U 16/09 -).</span></p>\r\n<p><span style="font-size: small;">Photo: jufo - Fotolia.com</span></p>', 0, 3, 62, 1, '4af1d0fa06cbd.com', '2009-11-04 19:03:31', '0000-00-00 00:00:00'),
(119, 'Anforderungen bei Wirkversprechen', '<p><span style="font-size: medium;"><strong><span style="color: #993300;">Entscheidung&nbsp;des Landgerichts D&uuml;sseldorf zu Anforderungen bei der Werbung mit einer Heilwirkung eines kosmetischen Mittels</span></strong></span></p>\r\n<p><strong><span style="font-size: small;">Wird ein kosmetisches Mittel mit dem Versprechen einer Heilwirkung beworben, so muss die heilende Wirkung &nbsp;hinreichend wissenschaftlich belegt sein. Kann der Werbende den wissenschaftlichen Beleg nicht erbringen, so&nbsp;kann er von einem&nbsp;Mitbewerber&nbsp;auf Unterlassung der Werbung mit einem Wirkversprechen in Anspruch genommen werden</span><span style="font-size: small;">.</span></strong></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #800000;">Sachverhalt</span></strong></span></p>\r\n<p><span style="font-size: small;">Ein H&auml;ndler warb&nbsp;f&uuml;r eine "Naturblock-Seife" u. a. mit der Aussage: "hilft gegen ... Schuppenflechte, hilft gegen Akne". Hiergegen wandte sich ein Mitbewerber und&nbsp;forderte die sofortige&nbsp;Unterlassung vor dem Landgericht D&uuml;sseldorf in einem einstweiligen Verf&uuml;gungsverfahren. Der Werbende&nbsp;sah einen wissenschaftlichen Beleg f&uuml;r die Wirkung der Seife darin, dass die Seife haupts&auml;chlich aus Oliven- und Lorber&ouml;l bestehe, da&nbsp;diese &Ouml;le eine&nbsp;heilende Wirkung h&auml;tten.&nbsp;</span></p>\r\n<p><span style="font-size: small;"><span style="color: #993300;"><strong>Rechtlicher Hintergrund</strong></span></span></p>\r\n<p><span style="font-size: small;">Gem&auml;&szlig; &sect; 27 LFGB ist es u. a. verboten, kosmetische Mittel mit irref&uuml;hrenden Aussagen zu bewerben. Soweit trifft dies im Kern&nbsp;nicht nur auf kosmetische Mittel zu, sondern auf alle Produkte, da sich entsprechende Regelungen auch im allgemeinen Wettbewerbsrecht wiederfinden. &sect; 27 LFGB geht jedoch hier&uuml;ber hinaus und&nbsp;normiert, dass&nbsp;bei kosmetischen Mitteln nur dann mit einer Wirkung&nbsp;geworben werden darf, wenn diese hinreichend wissenschaftlich belegt ist.</span></p>\r\n<p><span style="font-size: small;"><span style="color: #993300;"><strong>Beurteilung durch das LG D&uuml;sseldorf</strong></span></span></p>\r\n<p><span style="font-size: small;">Das Landgericht D&uuml;sseldorf&nbsp;wandte neben&nbsp;&sect; 27 LFGB auch Vorschriften aus dem Heilmittelgesetz an, da&nbsp;in dem vorliegenden Fall&nbsp;mit einer heilenden Wirkung geworben worden war.&nbsp;In einem solchen Fall sind auch die Vorschriften des Heilmittelgesetzes zu beachten (vgl. &sect; 27 Abs. 2 LFGB). Ohnehin&nbsp;lag nach Auffassung des Gerichtes ein&nbsp;wissenschaftlicher Beleg f&uuml;r eine heilende Wirkung, wie sie in der Werbung f&uuml;r die Seife&nbsp;behauptet worden war,&nbsp;nicht vor. Insbesondere sei es nicht ausreichend, lediglich die Liste der Bestandteile des Produktes anzugeben und auf die Eigenschaften dieser Bestandteile zu verweisen. Dem Anspruch auf Unterlassung sei daher stattzugeben.</span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #993300;">Kritik</span></strong></span></p>\r\n<p><span style="font-size: small;">Die&nbsp;Entscheidung&nbsp;des Landgerichts D&uuml;sseldorf wurde weniger&nbsp;in seinem Ergebnis, als in einem Teil seiner Begr&uuml;ndung kritisiert. Denn in seiner Entscheidungsbegr&uuml;ndung vertrat das Gericht u. a. die Meinung, dass ein wissenschaftlicher Beleg f&uuml;r eine Heilwirkung durch klinische&nbsp;Untersuchungen zu erbringen sei. Diese m&uuml;ssten,&nbsp;hinsichtlich der Wirkung der einzelnen Zusammensetzung der verwendeten Stoffe, &uuml;ber Experimente und Untersuchungsreihen an Probanden &uuml;ber einen l&auml;ngeren Zeitraum erbracht werden. Dies jedoch so sagen die Kritiker, w&uuml;rde dazu f&uuml;hren, dass bei&nbsp;einem Kosmetikum bei dem eine Heilaussage getroffen werden soll, die selben Voraussetzungen&nbsp;zu erf&uuml;llen seien, wie bei einem Arzneimittel. Das habe der Gesetzgeber zum einen nicht gewollt und zum anderen k&ouml;nnten gerade kleinere Kosmetikhersteller eine solche klinische Studie nicht finanzieren.</span></p>\r\n<p><span style="font-size: small;">Photo:&nbsp;Julien Tromeur&nbsp;- Fotolia.com</span></p>', 0, 5, 70, 1, '4b041f9e5f047.com', '2009-11-08 21:54:29', '0000-00-00 00:00:00'),
(117, 'Inkassokosten - erstattungsfähig?', '<p><span style="font-size: medium;"><strong><span style="color: #993300;">Zur Erstattungsverpflichtung&nbsp;der Kosten eines Inkassounternehmens durch den Schuldner</span></strong></span></p>\r\n<p><span style="font-size: small;"><strong>Befindet sich ein Schuldner mit einer Zahlung in Verzug und beauftragt der Gl&auml;ubiger zur Beitreibung dieser Forderung einen Anwalt, kann der Gl&auml;ubiger gegen&uuml;ber dem Schuldner die Kosten der gesetzlichen anwaltlichen Verg&uuml;tung gem&auml;&szlig; den Vorschriften &uuml;ber den Verzug - &sect;&sect; 280 ff. BGB -&nbsp;erstattet verlangen. Vor diesem&nbsp;Hintergrund stellt sich die Frage,&nbsp;ob auch die Kosten eines Inkassounternehmens&nbsp;von dem Schuldner erstattet werden m&uuml;ssen.&nbsp;</strong></span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #993300;">Meinungsvielfalt</span></strong></span></p>\r\n<p><span style="font-size: small;">Die Rechtssprechung hat die Frage der Erstattungsf&auml;higkeit von Inkassokosten unterschiedlich beurteilt. Nach verschiedenen Urteilen soll der Gl&auml;ubiger gegen&uuml;ber dem Schuldner keinen Anspruch auf Erstattung der Kosten haben, die er f&uuml;r die Beauftragung eines Inkassounternehmens aufwenden musste. Nach anderen Urteilen k&ouml;nnen die Kosten eines Inkassounternehmens zumindest unter Umst&auml;nden erstattungsf&auml;hig sein. Bei der zuletzt vertretenen Meinung werden widerum zur H&ouml;he einer etwaigen Erstattungsf&auml;higkeit unterschiedliche Auffassungen vertreten. So wird zum einen eine Erstattungsf&auml;higkeit zugesprochen, wenn die entstandenen Kosten unterhalb der Kosten lagen, die bei der Beauftragung eines Anwalts angefallen w&auml;ren. Nach anderer Ansicht d&uuml;rfen die Kosten des Inkassounternehmens genauso hoch sein, wie&nbsp;Kosten die bei der Beauftragung eines&nbsp;Anwalts entstanden w&auml;ren. Nach anderer Meinung d&uuml;rften sie sogar in manchen F&auml;llen h&ouml;her liegen.</span></p>\r\n<p><span style="font-size: small;"><span style="color: #993300;"><strong>Verzugsschaden</strong></span></span></p>\r\n<p><span style="font-size: small;">Soweit die Auffassung vertreten wird, dass die Kosten eines Inkassounternehmens nicht erstattungsf&auml;hig sind, wird oft darauf verwiesen, dass hier kein Verzugsschaden vorliege. Denn wenn ein Gl&auml;ubiger einen Anwalt beauftragt, wendet er sich an einen versierten Juristen und fordert damit eine Leistung ab, die er in seinem Unternehmen i. d. R. nicht vorfindet. Hier steht also die juristische Beratung im Vordergrund. Die reine Beitreibung von Forderungen geh&ouml;rt hingegen zum normalen betrieblichen Ablauf. Beauftragt der Gl&auml;ubiger ein Inkassounternehmen,&nbsp;lagert er somit nur eine T&auml;tigkeit aus, die er sonst selber vornehmen w&uuml;rde und die auch zu&nbsp;dem allgemeinen&nbsp;Arbeitsabauf eines Betriebes geh&ouml;rt. Die Kosten, die durch die Beauftragung eines Inkassounternehmens&nbsp;dem Gl&auml;ubiger entstehen, stellen also nur normale Betriebskosten dar, die im Wege der Auslagerung von Betriebsaufgaben entstanden sind und sind daher keine Verzugskosten (vgl. OLG Dresden, Urteil vom 01.12.93 - 5 U 68/93 -; LG Berlin, Urteil vom 07.11.95 - 20 O 63/95 -; AG Bad Homburg, Urteil vom 24.05.83; AG Krefeld, Urteil vom 29.08.06 - 6 C 407/06 -; AG Bochum, Urteil vom 06.10.06 - 75 C 187/06).</span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #993300;">Erstattungsf&auml;higkeit</span></strong></span></p>\r\n<p><span style="font-size: small;">Nach einigen Auffassungen soll der Gl&auml;ubiger gegen&uuml;ber dem Schuldner unter bestimmten Voraussetzungen einen Anspruch auf Erstattung der Kosten eines Inkassounternehmens haben. Dies ergibt sich zumindest&nbsp;bei vielen Entscheidungen aus dem&nbsp;Umkehrschluss der Argumentation, mit denen Gerichte den Gl&auml;ubigern einen Kostenersattungsanspruch absprachen. So sei ein Erstattungsanspruch von Kosten der Einschaltung eines Inkassounternehmens dann nicht gegeben, wenn erkennbar gewesen sein soll, dass der Schuldner auch auf eine Mahnung eines Inkassounternehmens nicht zahlen w&uuml;rde (vgl. OLG K&ouml;ln, Urteil vom 12.01.01 - 19 U 85/00 -; OLG D&uuml;sseldorf, Urteil vom 19.09.96 - 5 U 28/96 -; OLG Oldenburg, Urteil vom 24.04.06 - 11 U 8/06 -). Im Umkehrschluss bedeutet dies, dass der Gl&auml;ubiger dann&nbsp;von dem Schuldner den&nbsp;Aufwand f&uuml;r die Beauftragung eines Inkassounternhemnes vom Schuldner beanspruchen kann, wenn er beweisen kann, dass&nbsp;er bei der Beauftragung des Inkassounternehmens erkennen konnte, dass der Schuldner auf eine Mahnung des Inkassounternehmens zahlen w&uuml;rde.&nbsp;F&uuml;r den Gl&auml;ubiger ist diese Auffassung jedoch ausgerechnet in den F&auml;llen problematisch, in denen der Schuldner auf die Mahnung des Inkassounternehmens nicht gezahlt hatte.</span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #993300;">Fazit</span></strong></span></p>\r\n<p><span style="font-size: small;">F&uuml;r einen Gl&auml;ubiger kann die Beauftragung eines Inkassounternehmens dann einen Sinn machen, wenn er beabsichtigt, diese T&auml;tigkeit aus seinem Unternehmen auszulagern. Im g&uuml;nstigsten Fall kann er&nbsp;in einigen Gerichtsbezirken sogar die diesbez&uuml;glich anfallenden Kosten f&uuml;r die&nbsp;Auslagerung dieser T&auml;tigkeit vom Schuldner ersetzt bekommen. In den anderen F&auml;llen erscheint jedoch die Einschaltung eines&nbsp;auf dem Gebiet des&nbsp;Forderungseinzuges versierten Rechtsanwaltes die bessere Alternative.&nbsp;</span></p>', 0, 1, 67, 1, '4af1753b9f866.com', '2009-11-03 21:58:58', '0000-00-00 00:00:00'),
(123, 'Keine Urlaubsabgeltung bei widerruflicher Freistellung', '<p><span style="font-size: medium;"><strong><span style="color: #993300;">Eine Abgeltungsklausel f&uuml;hrt nicht immer zum Ziel</span></strong></span></p>\r\n<p><span style="font-size: small;"><strong>Das Bundesarbeitsgericht hat in einem Urteil aus Mai 2009 entschieden, dass eine Klausel auf Abgeltung des Urlaubs w&auml;hrend der Dauer der Freistellung dann nicht wirksam ist, wenn die Freistellung widerruflich erfolgt.</strong></span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #993300;">Grundsatz</span></strong></span></p>\r\n<p><span style="font-size: small;">Kann der Urlaub des Arbeitnehmers im Falle der Beendigung des Arbeitsverh&auml;ltnisses nicht mehr gew&auml;hrt werden, muss er vom Arbeitgeber abgegolten werden. H&auml;ufig m&ouml;chte der Arbeitgeber den Arbeitnehmer nach Ausspruch einer K&uuml;ndigung in seinem Betrieb nicht weiter besch&auml;ftigen und stellt ihn daher - sofern ein Anspruch hierauf besteht - von der Verpflichtung zur Arbeit unter Fortsetzung der Lohnzahlungen frei. Es liegt im Interesse des Arbeitgebers, die Zeit der Freistellung mit dem bestehenden Urlaubsanspruch durch Formulierung&nbsp;einer entsprechenden Klausel&nbsp;verrechnen zu k&ouml;nnen. </span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #993300;">Sachverhalt</span></strong></span></p>\r\n<p><span style="font-size: small;">In dem entschiedenen Fall hatte der Arbeitgeber in dem K&uuml;ndigungsschreiben die Klausel aufgenommen: "..... stellen wir Sie ab sofort bis auf Widerruf unter Fortzahlung der Bez&uuml;ge und unter Anrechnung Ihres Resturlaubsanspruchs und dem Guthaben auf dem Gleitzeit/Freizeitkonto von jeglicher Arbeit frei." </span></p>\r\n<p><span style="font-size: small;">Die Arbeitnehmerin hatte bei Zugang der K&uuml;ndigung noch Anspruch auf Gew&auml;hrung von sechs Urlaubstagen und ein Stundenguthaben von 122,5 Stunden gem&auml;&szlig; ihrem Gleitzeitkonto. Nach Beendigung des Arbeitsverh&auml;ltnisses verlangte die Arbeitnehmerin von dem Arbeitgeber die Abgeltung des noch ausstehenden Urlaubs und des Stundenguthabens aus ihrem Gleitzeitkonto.</span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #993300;">Entscheidung</span></strong></span></p>\r\n<p><span style="font-size: small;">Das Bundesarbeitsgericht vertrat die Auffassung, dass die Arbeitnehmerin einen Anspruch auf Abgeltung von sechs Urlaubstagen habe, da die Abgeltungsklausel unwirksam sei, soweit der Urlaubsanspruch abgegolten werden sollte. Da die Freistellung nur widerruflich ausgesprochen worden sei, habe die Arbeitnehmerin keinen Erholungsurlaub antreten k&ouml;nnen, da der Arbeitgeber die Freistellung jederzeit h&auml;tte widerrufen k&ouml;nnen. Eine wirksame Abgeltungsklausel hinsichtlich des Urlaubsanspruches setze&nbsp;somit voraus, dass die Freistellung unwiderruflich erfolge.</span></p>\r\n<p><span style="font-size: small;">Zu einer anderen Einsch&auml;tzung gelangte das Bundesarbeitsgericht im Hinblick auf die Verrechnung der Freistellung mit dem Stundenguthaben. Hier&nbsp;habe die Arbeitnehmerin kein schutzw&uuml;rdiges Interesse an der&nbsp;Unwiderruflichkeit der Freistellung.&nbsp;</span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #993300;">Bundesarbeitsgericht, 19. Mai 2009</span></strong></span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #993300;">Aktenzeichen 9 AZR 433/08&nbsp;</span></strong></span></p>\r\n<p><span style="font-size: small;"><span style="color: #000000;">Photo: Martin Fischer - Fotolia.com</span></span></p>', 0, 6, 53, 1, '4b13bafb5033a.com', '2009-11-30 12:30:51', '0000-00-00 00:00:00'),
(125, 'Bezeichnung eines Badezusatzes als Thermal Bad', '<p><span style="font-size: medium;"><strong><span style="color: #993300;">Vorwurf der Irref&uuml;hrung durch die Produktbezeichnung</span></strong></span></p>\r\n<p><span style="font-size: small;"><strong>Im Jahre 2002 hatte der Bundesgerichtshof sich mit dem&nbsp;Streit zweier Wettbewerbskontrahenten auseinanderzusetzen und u. a. zu entscheiden, ob die Bezeichnung "Thermal Bad" f&uuml;r eine im Badewasser zu l&ouml;sende Tablette irref&uuml;hrend sei, die nicht aus nat&uuml;rlichem Thermalquellwasser gewonnen, sondern auf synthetischem Wege hergestellt wird.</strong></span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #993300;">Sachverhalt</span></strong></span></p>\r\n<p><span style="font-size: small;">Der&nbsp;Beklagte vertrieb sein Produkt, einen Badewasserzusatz, u. a. mit der Bezeichnung "THERMAL BAD - DIE THERMAL BADEKUR F&Uuml;R ZUHAUSE". Der Kl&auml;ger vertrat die Auffassung, dass diese Bezeichnung wettbewerbswidrig sei, da der Verbaucher annehmen m&uuml;sse, dass die in dem Produkt enthaltenen Mineralien einer nat&uuml;rlichen Thermalquelle entzogen seien. Des Weiteren seien solche Produkte als Arzneimittel einzustufen.</span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #993300;">Entscheidung</span></strong></span></p>\r\n<p><span style="font-size: small;">Das Gericht konnte sich der Auffassung des Kl&auml;gers nicht anschlie&szlig;en und entschied, dass es sich bei dem streitgegenst&auml;ndlichen Produkt weder um ein Arzneimittel handele, noch die Bezeichnung des Badezusatzes irref&uuml;hrend sei. </span></p>\r\n<p><span style="font-size: small;">Aus der Zweckbestimmung des Mittels w&uuml;rde sich keine Anwendung ergeben, am oder im K&ouml;rper Krankheiten, Leiden, K&ouml;rpersch&auml;den oder krankhafte Beschwerden zu heilen, zu lindern, zu verh&uuml;ten oder zu erkennen. Vielmehr weise die Beklagte nur darauf hin, dass ihr Produkt wohltuend wirke und der Gesundheit f&ouml;rderlich sei. Zwar verbinde der Verbraucher hiermit die Vorstellung, dass ein solches Produkt vorbeugende Wirkung habe, dies spreche jedoch f&uuml;r sich genommen nicht f&uuml;r ein Arzneimittel.</span></p>\r\n<p><span style="font-size: small;">Auch liege durch die Bezeichnung des Produktes als Thermal Bad keine Irref&uuml;hrung vor. Unstreitig war zwischen den Parteien, dass das Produkt &uuml;ber Inhaltsstoffe verf&uuml;gt, die&nbsp;bei einer L&ouml;sung im Badewasser zu einer Zusammensetzung f&uuml;hrt, die dem einer nat&uuml;rlichen Thermalquelle gleichkommt. Von etwas anderem w&uuml;rde jedoch auch ein durchschnittlich informierter, verst&auml;ndiger und situationsangemessen aufmerksamer Durchschnittverbraucher nicht ausgehen.</span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #993300;">Bundesgerichtshof, 26.&nbsp;September 2002</span></strong></span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #993300;">Aktenzeichen: I ZR 89/00&nbsp;</span></strong></span></p>\r\n<p><span style="font-size: small;"><span style="color: #000000;">Photo: Serguei Kovalev - Fotolia.com</span></span></p>', 0, 5, 72, 1, '4b141c559940a.com', '2009-11-30 19:26:13', '0000-00-00 00:00:00'),
(128, 'Kündigungsfristen verstoßen teilweise gegen EU-Recht', '<p><span style="font-size: medium;"><span style="color: #993300;"><strong>Europ&auml;ischer Gerichtshof (EuGH)&nbsp;kippt Teile der K&uuml;ndigungsfristen im deutschen Arbeitsrecht</strong></span></span></p>\r\n<p><span style="font-size: small;"><strong>Bei der Berechnung der K&uuml;ndigungsfristen m&uuml;ssen k&uuml;nftig Besch&auml;ftigungszeiten, die vor der Vollendung des 25. Lebensjahres liegen, mit ber&uuml;cksichtigt werden.</strong></span></p>\r\n<p><span style="font-size: small;"><span style="color: #993300;"><strong>Sachverhalt</strong></span></span></p>\r\n<p><span style="font-size: small;">Welche gesetzlichen Fristen der Arbeitgeber bei der K&uuml;ndigung eines Arbeitnehmers einhalten muss, richtet sich nach der Besch&auml;ftigungsdauer. Nach dem Gesetz (&sect; 622 BGB) sind jedoch solche Besch&auml;ftigungszeiten nicht zu ber&uuml;cksichtigen, die der Arbeitnehmer vor Vollendung seines 25. Lebensjahres absolviert hat. Wurde also bisher einem j&uuml;ngeren Arbeitnehmer gek&uuml;ndigt, musste der Arbeitgeber nur die Mindestfrist von 4 Wochen zum 15. eines Monats bzw. zum Monatsende einhalten (sofern keine anderweitige arbeitsrechtliche Vereinbarung - Tarifvertrag, Individualarbeitsvertrag - vorlag) und zwar auch dann, wenn der Arbeitnehmer schon mehrere Jahre in dem Betrieb besch&auml;ftigt war. Auch bei Arbeitnehmern, die &auml;lter als 25 Jahre waren galt, dass nur&nbsp;die Besch&auml;ftigungszeiten anerkannt wurden, die nach Vollendung des 25. Lebensjahres lagen.</span></p>\r\n<p><span style="font-size: small;"><span style="color: #993300;"><strong>Entscheidung des EuGH</strong></span></span></p>\r\n<p><span style="font-size: small;">Der EuGH entschied nun, dass diese Regelung j&uuml;ngere Arbeitnehmer diskriminiert und somit gegen die EU-Richtlinie 2000/78 verst&ouml;&szlig;t,&nbsp;dergem&auml;&szlig; ein europarechtlicher Gleichbehandlungsgrundsatz gilt.&nbsp;Das Gericht stellte klar, dass eine Ungleichbehandlung nur unter strengen objektiven Aspekten gerechtfertigt sei, wie z. B. besch&auml;ftigungspolitische Ma&szlig;nahmen. Dann sei jedoch die Verh&auml;ltnism&auml;&szlig;igkeit der Mittel zu pr&uuml;fen. Vorliegend sei&nbsp;jedoch die Ungleichbehandlung von j&uuml;ngeren Menschen nicht&nbsp;geboten.&nbsp;</span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #993300;">Folgen</span></strong></span></p>\r\n<p><span style="font-size: small;">Das Urteil des EuGH wird wohl&nbsp;kurzfristig dazu f&uuml;hren, dass die nationalen Gerichte&nbsp;bei der Berechnung der K&uuml;ndigungsfristen, Besch&auml;ftigungszeiten die vor dem 25. Lebensjahr erbracht wurden, mit ber&uuml;cksichtigen werden. Mittelfristig wird wohl der nationale Gesetzgeber den &sect; 622 BGB entsprechend &auml;ndern.</span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #993300;">EuGH, Entscheidung vom 19.01.2010</span></strong></span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #993300;">Aktenzeichen: C-555/07</span></strong>&nbsp;</span></p>\r\n<p><span style="font-size: small;">Photo: Jaimie Duplass - fotoila.com</span></p>', 0, 6, 53, 1, '4b9e69bb36640.com', '2010-03-15 17:09:15', '0000-00-00 00:00:00'),
(131, 'Sonn- und Feiertagszuschläge', '<p><span style="font-size: medium;"><strong><span style="color: #993300;">Gibt es einen gesetzlichen Anspruch auf Sonn- und Feiertagszuschl&auml;ge?</span></strong></span></p>\r\n<p><span style="font-size: small;"><strong>Das Bundesarbeitsgericht (BAG) hatte &uuml;ber die Frage zu entscheiden, ob ein Arbeitnehmer, der an einem Sonn- oder Feiertag arbeiten muss, einen gesetzlichen Anspruch auf einen Zuschlag zur normalen Verg&uuml;tung hat.</strong></span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #993300;">Gesetzliche Grundlagen</span></strong></span></p>\r\n<p><span style="font-size: small;">Ein Anspruch des Arbeitnehmers k&ouml;nnte sich aus den Vorschriften des Arbeitzeitgesetzes ergeben. Dort ist geregelt (&sect; 6 Abs 5 ArbZG), dass Arbeitnehmer, die Nachtarbeit leisten m&uuml;ssen, einen Anspruch auf eine angemessene Zahl bezahlter freier Tage haben oder einen angemessenen Zuschlag auf den Bruttolohn erhalten. F&uuml;r Sonn- und Feiertage verweist das Gesetz auf diese Vorschrift.</span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #993300;">Entscheidung des BAG</span></strong></span></p>\r\n<p><span style="font-size: small;">Das Bundesarbeitsgericht urteilte, dass die Verweisung des Gesetzes auf die benannte Vorschrift nur besagt, dass auch an Sonn- und Feiertagen ein Zuschlag bei Nachtarbeit zu leisten ist. Hingegen folgt hieraus nicht, dass bei einer Besch&auml;ftigung au&szlig;erhalb der Nachtarbeit an Sonn- und Feiertagen ein Anspruch des Arbeitnehmers auf einen Lohnzuschlag besteht. Der Arbeitgeber muss hier lediglich einen Ersatzruhetag anbieten. Dar&uuml;ber hinaus m&uuml;ssen mindestens 15 Sonntage im Jahr besch&auml;ftigungsfei bleiben.</span></p>\r\n<p><span style="font-size: small;">Ein Anspruch auf einen Sonn- bzw. Feiertagszuschlag kann sich jedoch aus einem Tarifvertrag oder aus einem Arbeitsvertrag ergeben.</span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #993300;">Bundesarbeitsgericht, Urteil vom 11.01.2006</span></strong></span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #993300;">Aktenzeichen: 5 AZR 97/05</span></strong></span></p>\r\n<p><span style="font-size: small;"><span style="color: #000000;">Photo: Michael Brown - fotoila.com</span></span></p>', 0, 6, 73, 1, '4bbdaad5b513d.com', '2010-04-08 10:07:17', '0000-00-00 00:00:00'),
(130, 'Übersicht: Sonderkündigungsschutz im Arbeitsrecht', '<p><span style="font-size: small;">Das deutsche Arbeitsrecht enth&auml;lt eine Vielzahl an sog. Sonderk&uuml;ndigungsschutztatbest&auml;nden, die den Ausspruch einer K&uuml;ndigung gegen&uuml;ber einem Arbeitnehmer erschweren oder ausschlie&szlig;en. Die nachfolgende Aufz&auml;hlung der Sonderk&uuml;ndigungsschutztatbest&auml;nde erhebt keinen Anspruch auf Vollst&auml;ndigkeit.</span></p>\r\n<table border="1" cellspacing="3" cellpadding="0" bgcolor="#f3f3f3">\r\n<tbody>\r\n<tr>\r\n<td width="205" valign="top">\r\n<p><span style="font-size: small;">&nbsp;<strong></strong></span></p>\r\n</td>\r\n<td width="205" valign="top">\r\n<h1><span style="font-size: small;">K&uuml;ndigungsbestimmungen</span></h1>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n</td>\r\n<td width="205" valign="top">\r\n<h1><span style="font-size: small;">Normen</span></h1>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="205" valign="top">\r\n<p><strong><span style="font-size: small;">Abfallbeauftragter / Immisionsschutzbeauftragter</span></strong></p>\r\n</td>\r\n<td width="205" valign="top">\r\n<p><span style="text-decoration: underline;"><span style="font-size: small;">ordentliche K&uuml;ndigung</span></span></p>\r\n<p><span style="font-size: small;">K&uuml;ndigungsschutz ab Bestellung bis ein Jahr nach Beendigung der Bestellung</span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="text-decoration: underline;"><span style="font-size: small;">au&szlig;erordentliche K&uuml;ndigung</span></span></p>\r\n<p><span style="font-size: small;">m&ouml;glich</span></p>\r\n</td>\r\n<td width="205" valign="top">\r\n<p><span style="font-size: small;">&sect; 55 Abs. 3 KrW-/AbfG i. V. m. &sect; 58 Abs. 2 BImSchG</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="205" valign="top">\r\n<p><strong><span style="font-size: small;">Auszubildender</span></strong></p>\r\n</td>\r\n<td width="205" valign="top">\r\n<p><span style="text-decoration: underline;"><span style="font-size: small;">ordentliche K&uuml;ndigung</span></span></p>\r\n<p><span style="font-size: small;">nach Ablauf der Probezeit ausgeschlossen</span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="text-decoration: underline;"><span style="font-size: small;">au&szlig;erordentliche K&uuml;ndigung</span></span></p>\r\n<p><span style="font-size: small;">m&ouml;glich</span></p>\r\n</td>\r\n<td width="205" valign="top">\r\n<p><span style="font-size: small;">&sect; 22 Abs. 3 BBiG</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="205" valign="top">\r\n<p><strong><span style="font-size: small;">Auszubildendenvertreter oder Jugendvertreter</span></strong></p>\r\n</td>\r\n<td width="205" valign="top">\r\n<p><span style="text-decoration: underline;"><span style="font-size: small;">ordentliche K&uuml;ndigung</span></span></p>\r\n<p><span style="font-size: small;">K&uuml;ndigungsschutz von Beginn der Amtszeit bis 6 Monate nach Beendigung</span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="text-decoration: underline;"><span style="font-size: small;">au&szlig;erordentliche K&uuml;ndigung</span></span></p>\r\n<p><span style="font-size: small;">nur mit vorheriger Zustimmung des Betriebsrates</span></p>\r\n</td>\r\n<td width="205" valign="top">\r\n<p><span style="font-size: small;">&sect; 15 KSchG</span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="font-size: small;">&sect; 103 BetrVerfG</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="205" valign="top">\r\n<p><strong><span style="font-size: small;">Befristet besch&auml;ftigte Arbeitnehmer</span></strong></p>\r\n</td>\r\n<td width="205" valign="top">\r\n<p><span style="text-decoration: underline;"><span style="font-size: small;">ordentliche K&uuml;ndigung</span></span></p>\r\n<p><span style="font-size: small;">ausgeschlossen, sofern nicht vertraglich etwas anderes vereinbart war</span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="text-decoration: underline;"><span style="font-size: small;">au&szlig;erordentliche K&uuml;ndigung</span></span></p>\r\n<p><span style="font-size: small;">m&ouml;glich</span></p>\r\n</td>\r\n<td width="205" valign="top">\r\n<p><span style="font-size: small;">&sect; 15 Abs. 3 TzBfG</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="205" valign="top">\r\n<p><strong><span style="font-size: small;">Betriebsratsmitglieder</span></strong></p>\r\n</td>\r\n<td width="205" valign="top">\r\n<p><span style="text-decoration: underline;"><span style="font-size: small;">ordentliche K&uuml;ndigung</span></span></p>\r\n<p><span style="font-size: small;">K&uuml;ndigungsschutz von Beginn der Amtszeit bis 6 Monate nach Beendigung</span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="text-decoration: underline;"><span style="font-size: small;">au&szlig;erordentliche K&uuml;ndigung</span></span></p>\r\n<p><span style="font-size: small;">nur mit vorheriger Zustimmung des Betriebsrates</span></p>\r\n</td>\r\n<td width="205" valign="top">\r\n<p><span style="font-size: small;">&sect; 15 KSchG</span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="font-size: small;">&sect; 103 BetrVerfG</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="205" valign="top">\r\n<p><strong><span style="font-size: small;">Betriebsratswahlen</span></strong></p>\r\n<p><strong><span style="font-size: small;">Wahlbewerber / Wahlvorst&auml;nde</span></strong></p>\r\n</td>\r\n<td width="205" valign="top">\r\n<p><span style="font-size: small;">K&uuml;ndigungsverbot ab Bestellung als Wahlvorstand bzw. der Aufstellung als Wahlbewerber bis 6 Monate nach der Betriebsratswahl</span></p>\r\n</td>\r\n<td width="205" valign="top">\r\n<p><span style="font-size: small;">&sect; 15 KSchG</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="205" valign="top">\r\n<p><strong><span style="font-size: small;">Datenschutzbeauftragter</span></strong></p>\r\n</td>\r\n<td width="205" valign="top">\r\n<p><span style="text-decoration: underline;"><span style="font-size: small;">ordentliche K&uuml;ndigung</span></span></p>\r\n<p><span style="font-size: small;">K&uuml;ndigungsschutz ab Bestellung bis ein Jahr nach Beendigung der Bestellung</span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="text-decoration: underline;"><span style="font-size: small;">au&szlig;erordentliche K&uuml;ndigung</span></span></p>\r\n<p><span style="font-size: small;">m&ouml;glich</span></p>\r\n</td>\r\n<td width="205" valign="top">\r\n<p><span style="font-size: small;">&sect; 4 f BDSG</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="205" valign="top">\r\n<p><strong><span style="font-size: small;">Elternzeit</span></strong></p>\r\n</td>\r\n<td width="205" valign="top">\r\n<p><span style="font-size: small;">Ab Verlangen der Elternzeit bis zu deren Ende keine K&uuml;ndigung m&ouml;glich.</span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="font-size: small;">Ausnahmen mit vorheriger Zustimmung wie bei Schwangeren m&ouml;glich.</span></p>\r\n</td>\r\n<td width="205" valign="top">\r\n<p><span style="font-size: small;">&sect; 18 Abs. 1 BEEG</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="205" valign="top">\r\n<p><strong><span style="font-size: small;">Insolvenz</span></strong></p>\r\n</td>\r\n<td width="205" valign="top">\r\n<p><span style="font-size: small;">Kein Sonderk&uuml;ndigungsrecht des Insolvenzverwalter oder des Arbeitnehmers, solange die beiderseitigen Pflichten weiter erf&uuml;llt werden.</span></p>\r\n</td>\r\n<td width="205" valign="top">\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="205" valign="top">\r\n<p><strong><span style="font-size: small;">Pflegezeit</span></strong></p>\r\n</td>\r\n<td width="205" valign="top">\r\n<p><span style="font-size: small;">Von der Ank&uuml;ndigung bis zur Beendigung der Pflegezeit oder kurzzeitigen Arbeitsverhinderung (sog. kleine Pflegezeit)</span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="font-size: small;">Ausnahmsweise kann mit beh&ouml;rdlicher Genehmigung auch w&auml;hrend der Pflegezeit gek&uuml;ndigt werden</span></p>\r\n</td>\r\n<td width="205" valign="top">\r\n<p><span style="font-size: small;">&sect; 5 Abs. 1 PflegeZG</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="205" valign="top">\r\n<p><strong><span style="font-size: small;">Probezeit</span></strong></p>\r\n</td>\r\n<td width="205" valign="top">\r\n<h1><span style="font-size: small;">W&auml;hrend einer vereinbarten Probezeit (darf l&auml;ngstens f&uuml;r die Dauer von 6 Monaten vereinbart werden), kann die K&uuml;ndigungsfrist auf zwei Wochen herabgesetzt werden.</span></h1>\r\n</td>\r\n<td width="205" valign="top">\r\n<h1><span style="font-size: small;">&sect; 622 Abs. 3 BGB</span></h1>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="205" valign="top">\r\n<p><strong><span style="font-size: small;">Mutterschutz</span></strong></p>\r\n</td>\r\n<td width="205" valign="top">\r\n<p><span style="font-size: small;">Ab Mitteilung der Schwangerschaft bis 4 Monate nach der Entbindung.</span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="font-size: small;">Ausnahmsweise kann mit beh&ouml;rdlicher Genehmigung auch w&auml;hrend der Schwangerschaft gek&uuml;ndigt werden. Die K&uuml;ndigung darf dann nichts mit der Schwangerschaft zu tun haben.</span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n</td>\r\n<td width="205" valign="top">\r\n<p><span style="font-size: small;">&sect; 9 MuSchG</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="205" valign="top">\r\n<p><strong><span style="font-size: small;">Schwerbehinderte</span></strong></p>\r\n</td>\r\n<td width="205" valign="top">\r\n<p><span style="font-size: small;">K&uuml;ndigung bedarf der vorherigen Zustimmung des Integrationsamtes</span></p>\r\n</td>\r\n<td width="205" valign="top">\r\n<p><span style="font-size: small;">&sect; 85 SGB IX</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="205" valign="top">\r\n<p><strong><span style="font-size: small;">Wehrdienstleistende</span></strong></p>\r\n</td>\r\n<td width="205" valign="top">\r\n<p><span style="font-size: small;">Ab Zustellung des Einberufungsbescheides bis Ende des Grundwehrdienstes</span></p>\r\n</td>\r\n<td width="205" valign="top">\r\n<p><span style="font-size: small;">&sect; 2 Abs. 1 ArbPlSchG</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="205" valign="top">\r\n<p><strong><span style="font-size: small;">Zivildienstleistende</span></strong></p>\r\n</td>\r\n<td width="205" valign="top">\r\n<p><span style="font-size: small;">Wie bei Wehrdienstleistenden</span></p>\r\n</td>\r\n<td width="205" valign="top">\r\n<p><span style="font-size: small;">&sect; 78 ZDG i. V. m. &sect; 2 Abs. 1 ArbPlSchG</span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', 0, 6, 53, 1, '', '2010-03-16 08:11:03', '0000-00-00 00:00:00');
INSERT INTO `artikel` (`id`, `titel`, `content`, `status`, `kat_id`, `ukat_id`, `premium`, `bild_name`, `date_created`, `date_modified`) VALUES
(133, 'Kündigungsschutzverzichtserklärung ohne Gegenleistung', '<p><span style="font-size: medium;"><span style="color: #993300;"><strong>Zur Wirksamkeit einer Verzichtserkl&auml;rung auf Erhebung der K&uuml;ndigungsschutzklage ohne Gew&auml;hrung einer Gegenleistung</strong></span></span></p>\r\n<p><span style="font-size: small;"><strong>Legt der Arbeitgeber dem Arbeitnehmer eine Erkl&auml;rung zur Unterschrift vor, aus der hervorgeht, dass der Arbeitnehmer auf die Erhebung der K&uuml;ndigungsschutzklage verzichtet und zwar ohne eine Gegenleistung vom Arbeitgeber zu erhalten, ist diese Erkl&auml;rung laut einem Urteil des Bundesarbeitgerichtes (BAG) unwirksam.</strong></span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #993300;">Sachverhalt</span></strong></span></p>\r\n<p><span style="font-size: small;">In dem vom BAG zu entscheidenden Fall hatte eine Arbeitnehmerin vom Arbeitgeber zun&auml;chst eine fristlose K&uuml;ndigung ihres Arbeitsverh&auml;ltnisses erhalten.&nbsp;Anschlie&szlig;end wurde ihr vom Arbeitgeber&nbsp;dann&nbsp;eine&nbsp;vorformulierte Erkl&auml;rung zur Unterschrift &uuml;bergeben, gem&auml;&szlig; derer die Arbeitnehmerin auf die Erhebung einer K&uuml;ndigungsschutzklage verzichtet. Eine Gegenleistung wurde der Arbeitnehmerin nicht zugesagt. Die Arbeitnehmerin hatte die Verzichtserkl&auml;rung zun&auml;chst unterschrieben, klagte dann jedoch gegen die ausgesprochene fristlose K&uuml;ndigung.</span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #993300;">Entscheidung des BAG</span></strong></span></p>\r\n<p><span style="font-size: small;">In seinem Urteil erkl&auml;rte das Bundesarbeitsgericht die von der Arbeitnehmerin&nbsp;unterschriebene Verzichtserkl&auml;rung f&uuml;r unwirksam. Der Verzicht eines Arbeitnehmers auf die M&ouml;glichkeit, die K&uuml;ndigungsschutzklage zu erheben, benachteilige diesen in einer unangemessenen Weise, wenn der Arbeitnehmer f&uuml;r diesen Verzicht keine Gegenleistung erhalte.</span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #993300;">Bundesarbeitsgericht, Urteil vom 06.09.2007</span></strong></span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #993300;">Aktenzeichen: 2 AZR 722/06</span></strong></span></p>\r\n<p><span style="font-size: small;">Photo: pdesign - fotoila.com</span></p>', 0, 6, 53, 1, '4bbdfc3f69579.com', '2010-04-08 15:52:07', '0000-00-00 00:00:00'),
(136, 'Wohnflächenabweichung', '<p><span style="font-size: medium;"><strong><span style="color: #993300;">Abweichung der im Mietvertrag angegebenen Wohnfl&auml;che zur tats&auml;chlichen Wohnfl&auml;che</span></strong></span></p>\r\n<p><span style="font-size: small;"><strong>Nach der st&auml;ndigen Rechtsprechung des Bundesgerichtshof liegt ein Sachmangel einer Mietwohnung dann vor, wenn die tats&auml;chliche Fl&auml;che der Wohnung mehr als 10 % geringer ist, als im Mietvertrag angegeben. In einer Entscheidung aus M&auml;rz 2010 stellte der BGH klar, dass bei der Beurteilung der Erheblichkeit des Mangels auch dann keine zus&auml;tzliche Toleranzspanne zu ber&uuml;cksichtigen ist, wenn in dem Mietvertrag bei der Wohnfl&auml;che eine "ca."-Angabe verwendet wird.</strong></span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #993300;">Sachverhalt</span></strong></span></p>\r\n<p><span style="font-size: small;">Die Wohnfl&auml;che der Mietwohnung war im Mietvertrag mit ca. 100 qm angegeben. Die Mieter forderten von dem Vermieter die R&uuml;ckzahlung von &uuml;berzahlter Miete, da die Wohnung nur &uuml;ber 81 qm verf&uuml;ge. Unter anderem machte der Vermieter geltend, dass&nbsp;der Mietvertrag nur eine cirka-Angabe zur Wohnfl&auml;che enthalte und daher f&uuml;r die Mieter erkennbar gewesen sei, dass&nbsp;eine Abweichung zur tats&auml;chlichen Wohnfl&auml;che vorhanden sein k&ouml;nne.&nbsp;</span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #993300;">Entscheidung</span></strong></span></p>\r\n<p><span style="font-size: small;">Der BGH entschied, dass die Angabe "ca." bei der Frage einer erheblichen Abweichung zwischen angegebener und tats&auml;chlicher Wohnfl&auml;che unerheblich sei. Weiche die Wohnfl&auml;che um mehr als 10 % von der tats&auml;chlichen Wohnfl&auml;che (nach unten) ab, liege ein erheblicher Sachmagel vor.</span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #993300;">Folge</span></strong></span></p>\r\n<p><span style="font-size: small;">Liegt ein erheblicher Sachmangel vor, ist der Mieter berechtigt, die Miete zu mindern. Dar&uuml;ber hinaus kann der Mieter in diesen F&auml;llen auch noch nachtr&auml;glich die zuviel gezahlte Miete zur&uuml;ck fordern (zumindest f&uuml;r den unverj&auml;hrten Zeitraum).</span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #993300;">Bundesgerichtshof, Urteil vom 10.03.2010</span></strong></span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #993300;">Aktenzeichen: VIII ZR 144/09</span></strong></span></p>\r\n<p><span style="font-size: small;"><span style="color: #000000;">Photo: Christian Nitz - fotoila.com</span></span></p>', 0, 2, 75, 1, '4bc8809f7fbff.com', '2010-04-16 15:22:07', '0000-00-00 00:00:00'),
(135, 'Sonderurlaub', '<p><strong><span style="font-size: medium;"><span style="color: #993300;">&nbsp;</span></span></strong></p>\r\n<p><strong><span style="font-size: medium;"><span style="color: #993300;">Der Anspruch auf Sonderurlaub</span></span></strong></p>\r\n<p><span style="font-size: small;"><strong>Meist ist in einem Arbeitsvertrag klar geregelt, wieviel Urlaub&nbsp;dem Arbeitnehmer zusteht. Dar&uuml;ber hinaus kann dem Arbeitnehmer ein gesetzlicher Anspruch auf Gew&auml;hrung von Sonderurlaub zustehen. Gem&auml;&szlig; &sect; 616 BGB ist der Arbeitgeber verpflichtet, dem Arbeitnehmer bezahlten Sonderurlaub zu gew&auml;hren, wenn er f&uuml;r eine verh&auml;ltnissm&auml;&szlig;ig nicht erhebliche Zeit durch einen in seiner Person liegenden Grund ohne sein Verschulden an der Dienstleistung verhindert wird. </strong></span></p>\r\n<p><span style="font-size: small;"><strong>Eine klare Regelung, in welchen F&auml;llen von einem solchen Grund auszugehen ist, kann der Vorschrift nicht entnommen werden.</strong></span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #993300;">Allgemein anerkannte F&auml;lle</span></strong></span></p>\r\n<p><span style="font-size: small;">Da das Gesetz keine klare Fallregelung zur Verf&uuml;gung stellt, soll nachfolgend dargestellt werden, in welchen F&auml;llen und f&uuml;r welchen Zeitraum Sonderurlaub gew&auml;hrt werden sollte:</span></p>\r\n<p><span style="font-size: small;">- Arzttermine, die nicht au&szlig;erhalb der Arbeitzeit wahr genommen werden k&ouml;nnen;</span></p>\r\n<p><span style="font-size: small;">- die Erf&uuml;llung von staatsb&uuml;rgerlichen Pflichten (z. B. Zeugenaussagen vor Gericht);</span></p>\r\n<p><span style="font-size: small;">- Teilnahme an Veranstaltungen von Gewerkschaften und Berufsverb&auml;nden (bis zu 10 Arbeitstage im Jahr);</span></p>\r\n<p><span style="font-size: small;">- Niederkunft der Ehe- oder Lebenspartnerin (1 Arbeitstag);</span></p>\r\n<p><span style="font-size: small;">- Tod eines nahen Angeh&ouml;rigen (Ehe- oder Lebenspartner, Kinder und Eltern - 2 Arbeitstage);</span></p>\r\n<p><span style="font-size: small;">- betrieblicher oder dienstlicher Umzug (1 Arbeitstag);</span></p>\r\n<p><span style="font-size: small;">- schwere Erkrankung von im Haushalt lebenden Angeh&ouml;rigen (1 Arbeitstag, bei Kindern oder Betreuungspersonen von Kindern 4 Arbeitstage pro Kind, wenn keine andere Betreuungsperson vorhanden ist).</span></p>\r\n<p><span style="font-size: small;">Dar&uuml;ber hinaus kann gem. &sect; 45 SGB V ein Anspruch auf unbezahlte Freistellung bestehen, wenn sich&nbsp;im Haushalt ein erkranktes Kind befindet, das Versorgung ben&ouml;tigt. Auch k&ouml;nnen&nbsp;Anspr&uuml;che auf Gew&auml;hrung von Sonderurlaub durch Tarifvertr&auml;ge beschr&auml;nkt oder erweitert werden. F&uuml;r Beamte&nbsp;existieren Sonderregelungen.&nbsp;&nbsp;</span></p>\r\n<p><span style="font-size: small;">Photo: pdesign - fotoila.com</span></p>', 0, 6, 54, 1, '4bbf49b184c0d.com', '2010-04-09 15:36:40', '0000-00-00 00:00:00'),
(137, '"Ginko-Plus" Hinweisbeschluss', '<p><span style="font-size: medium;"><strong><span style="color: #800000;">Wirkaussagen im Rahmen der wissenschaftlichen Erkenntnisse</span></strong></span></p>\r\n<p><span style="font-size: small;"><strong>Das Kammergericht hatte &uuml;ber die Frage zu urteilen, ob wissenschaftliche Erkenntnisse, die die Wirkung von Trockenextrakten aus Ginkobl&auml;ttern betreffen, ohne weiteres auf die Wirkung von pulverisierten Ginkobl&auml;ttern &uuml;bertragen werden k&ouml;nnen.</strong></span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #800000;">Sachverhalt</span></strong></span></p>\r\n<p><span style="font-size: small;">Die Beklagte bewarb ein Mittel, welches pulverisierte Ginkobl&auml;tter enthielt und st&uuml;tzte sich bei ihren Werbeaussagen auf wissenschaftliche Erkenntnisse, die&nbsp;bei der Wirkweise&nbsp;von Trockenextrakten aus Ginkobl&auml;ttern gewonnen worden waren. Das Gericht hatte dar&uuml;ber zu entscheiden, ob diese - f&uuml;r Trockenextrakte aus Ginkobl&auml;ttern - gewonnenen wissenschaftlichen Erkenntnisse auch auf pulverisierte Ginkobl&auml;tter anzuwenden seien.</span></p>\r\n<p><span style="font-size: small;">&nbsp;</span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #800000;">Ergebnis</span></strong></span></p>\r\n<p><span style="font-size: small;">Das Kammergericht schloss sich dem erstinstanzlichen Urteil an, demgem&auml;&szlig; es Sache des werbenden Unternehmens sei zu beweisen, dass&nbsp;die Erkenntnisse zur Wirkung von Ginkobl&auml;ttern&nbsp;bei einem&nbsp;Verfahren zur Gewinnung von Trockenextrakten sich ohne weiteres auch auf die Wirkung von&nbsp;pulverisierten Ginkobl&auml;ttern &uuml;bertragen lasse.&nbsp;</span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #800000;">Beweisangebot abgelehnt</span></strong></span></p>\r\n<p><span style="font-size: small;">Das beklagte Unternehmen hatte genau zu dieser Frage Beweis durch die Einholung eines Sachverst&auml;ndigengutachtens angeboten. Dies lehnte jedoch das Kammergericht mit dem Hinweis ab, dass sich der Werbende nur auf solche wissenschaftlichen Erkenntnisse st&uuml;tzen k&ouml;nne, die im Zeitpunkt der Werbung bereits vorl&auml;gen. Die Einholung eines Gutachtens im Prozess w&uuml;rde dazu f&uuml;hren, dass die notwendigen wissenschaftlichen Erkenntnisse erst&nbsp;im laufenden Prozess&nbsp;gewonnen w&uuml;rden, also im Zeitpunkt der Werbeaussage nicht vorliegen m&uuml;ssten.</span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #800000;">Kammergericht - Hinweisbeschluss vom 02.11.10</span></strong></span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #800000;">Az.: 5 U 83/09</span></strong></span></p>', 0, 5, 70, 1, '4d19b4fe70e14.com', '2010-12-28 09:59:26', '0000-00-00 00:00:00'),
(138, 'Zur Werbung mit Ultraschall', '<p><span style="font-size: medium;"><span style="color: #800000;"><strong>Die Bewerbung einer Ultraschallbehandlung mit der Auslobung einer vollst&auml;ndigen und dauerhaften Fettreduktion ist nach Ansicht des Landgericht M&uuml;nchen unzul&auml;ssig, da die Wirkaussagen (im konkreten Fall) nicht wissenschaftlich belegt seien.</strong></span></span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #800000;">Sachverhalt</span></strong></span></p>\r\n<p><span style="font-size: small;">Der Werbende bot eine Ultraschallbehandlung als Alternative zur Fettabsaugung an und bewarb diese u. a. mit den Aussagen: "Fettpolster weg mit Ultraschall", "...sofort messbares Ergebnis...", "Sie bestimmen, wo Fett abgebaut wird", "...ganz nebenbei verschwindet Cellulite...". Das Landgericht M&uuml;nchen hatte &uuml;ber die Zul&auml;ssigkeit dieser Aussagen zu urteilen.</span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #800000;">Beweislast und Ma&szlig;stab f&uuml;r die Richtigkeit</span></strong></span></p>\r\n<p><span style="font-size: small;">Das LG M&uuml;nchen hielt zun&auml;chst einmal fest, dass der Werbende verpflichtet sei konkret darzulegen und zu beweisen, dass seine Werbeaussagen zutreffend und richtig seien. Zum Ma&szlig;stab f&uuml;hrte das Gericht aus, dass eine Wirkaussage dann schon nicht get&auml;tigt werden d&uuml;rfe, wenn die Wirkung wissenschaftlich umstritten sei. Zumindest sei dann die Gegenansicht ebenfalls darzustellen. Generell d&uuml;rften jedoch nur solche Wirkaussagen get&auml;tigt werden, die&nbsp;nach dem Stand der wissenschaftlichen Erkenntnisse tats&auml;chlich vorliegen.</span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #800000;">Zu den wissenschaftlichen Erkenntnissen bei Ultraschallbehandlungen</span></strong></span></p>\r\n<p><span style="font-size: small;">Zumindest in dem Fall, &uuml;ber den das LG M&uuml;nchen zu entscheiden hatte, konnten&nbsp;hinreichende wissenschaftliche Erkenntnisse zur Wirksamkeit von Ultraschallbehandlungen bei der Fettreduktion nicht vorgelegt werden. Dem Gericht lagen verschiedene Gutachten bzw.&nbsp;wissenschaltliche Aufs&auml;tze vor, aus denen sich ergab, dass die&nbsp;Wirksamkeit der Ultraschallbehandlung zur Fettreduktion zumindest umstritten sei. Demgegen&uuml;ber legte das beklagte Unternehmen Aussagen seiner Kunden vor, die der Behandlung eine fettreduzierende Wirkung attestierten. Letztere&nbsp;schriftliche Aussagen (teilweise eidesstattlich versichert)&nbsp;r&auml;umte das Landgericht jedoch&nbsp;keinen Beweiswert zu, da diese Aussagen nicht repr&auml;sentativ und nicht geeignet seien, eine wissenschaftliche Studie&nbsp;zu ersetzen.</span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #800000;">Landgericht M&uuml;nchen I, Urteil vom 12.10.2010</span></strong></span></p>\r\n<p><span style="font-size: small;"><strong><span style="color: #800000;">Az.: 33 O 12528/10</span></strong></span></p>', 0, 5, 70, 1, '4d19fa8065272.com', '2010-12-28 10:52:37', '0000-00-00 00:00:00');
