INSERT INTO `newsletter` (`id`, `titel`, `content`, `plain`, `bild_name`, `erstellt`, `versendet`, `logo_typ`) VALUES
(201, 'ICADA-Tagung am 17.11.2010', '<p><span style="font-size: small;">Sehr geehrte Damen und Herren,</span></p>\r\n<p style="text-align: justify;"><span style="font-size: small;">auf der o. g. Tagung m&ouml;chten Herr Dr. Bursch (<a href="http://www.chemie-vorschrift.de">www.chemie-vorschrift.de</a>) und&nbsp;ich mit Ihnen gerne wieder einige Fragen zu dem Thema "praktische Konsequenzen zur neuen EU-KVO" besprechen.</span></p>\r\n<p style="text-align: justify;"><span style="font-size: small;">Damit der hiermit verbundene Vortrag einerseits strukturiert&nbsp;gestaltet werden kann und andererseits nicht an Ihren Fragen vorbei geht, bitte ich Sie, mir bei Interesse solche Punkte mitzuteilen, von denen Sie glauben, dass diese in der praktischen Umsetzung f&uuml;r die Kosmetikbranche&nbsp;bedeutendent oder schwierig werden k&ouml;nnten oder aus sonstigen Gr&uuml;nden zur Sprache kommen sollten.</span><span style="font-size: small;">&nbsp;</span></p>\r\n<p style="text-align: justify;"><span style="font-size: small;">F&uuml;r Ihre Anregungen vielen Dank.&nbsp;Zusammen mit dem ICADA Vorstand und dem&nbsp;Gesch&auml;ftsf&uuml;hrer,&nbsp;freuen&nbsp;Herr Dr. Bursch und ich&nbsp;uns darauf, Sie auf der ICADA-Tagung am 17.11.10 zu treffen.</span></p>', 'Sehr geehrte Damen und Herren,\r\nauf der o. g. Tagung m&ouml;chten Herr Dr. Bursch (www.chemie-vorschrift.de) und&nbsp;ich mit Ihnen gerne wieder einige Fragen zu dem Thema "praktische Konsequenzen zur neuen EU-KVO" besprechen.\r\nDamit der hiermit verbundene Vortrag einerseits strukturiert&nbsp;gestaltet werden kann und andererseits nicht an Ihren Fragen vorbei geht, bitte ich Sie, mir bei Interesse solche Punkte mitzuteilen, von denen Sie glauben, dass diese in der praktischen Umsetzung f&uuml;r die Kosmetikbranche&nbsp;bedeutendent oder schwierig werden k&ouml;nnten oder aus sonstigen Gr&uuml;nden zur Sprache kommen sollten.&nbsp;\r\nF&uuml;r Ihre Anregungen vielen Dank.&nbsp;Zusammen mit dem ICADA Vorstand und dem&nbsp;Gesch&auml;ftsf&uuml;hrer,&nbsp;freuen&nbsp;Herr Dr. Bursch und ich&nbsp;uns darauf, Sie auf der ICADA-Tagung am 17.11.10 zu treffen.', '4cbc6a69be977.jpg', '2011-01-19 20:50:47', '', 2),
(208, 'Jahreswechsel', '<p><span style="font-size: small;">Sehr geehrte Damen und Herren,</span></p>\r\n<p><span style="font-size: small;">zum bevorstehenden Jahreswechsel m&ouml;chte ich die Gelegenheit nutzen, mich f&uuml;r Ihr Vertrauen und Ihre Empfehlungen zu bedanken.</span></p>\r\n<p><span style="font-size: small;">2012 wird mit Sicherheit wieder recht turbulent werden und wir d&uuml;rfen alle gespannt sein, wie die aktuellen Probleme gel&ouml;st werden (oder auch nicht gel&ouml;st werden).</span></p>\r\n<p><span style="font-size: small;">F&uuml;r Ihren eigenen Bereich mache ich Sie (f&uuml;r Altforderungen) noch kurz auf die Verj&auml;hrungsproblematik zum Jahreswechsel&nbsp;aufmerksam.</span></p>\r\n<p><span style="font-size: small;">Ich w&uuml;nsche Ihnen, dass Sie zum Jahresende etwas Entspannung finden k&ouml;nnen und ein wenig zur Ruhe kommen.</span></p>\r\n<p><span style="font-size: small;">Frohe Weihnachten und ein erfolgreiches neues Jahr.</span></p>', 'Sehr geehrte Damen und Herren,\r\nzum bevorstehenden Jahreswechsel m&ouml;chte ich die Gelegenheit nutzen, mich f&uuml;r Ihr Vertrauen und Ihre Empfehlungen zu bedanken.\r\n2012 wird mit Sicherheit wieder recht turbulent werden und wir d&uuml;rfen alle gespannt sein, wie die aktuellen Probleme gel&ouml;st werden (oder auch nicht gel&ouml;st werden).\r\nF&uuml;r Ihren eigenen Bereich mache ich Sie (f&uuml;r Altforderungen) noch kurz auf die Verj&auml;hrungsproblematik zum Jahreswechsel&nbsp;aufmerksam.\r\nIch w&uuml;nsche Ihnen, dass Sie zum Jahresende etwas Entspannung finden k&ouml;nnen und ein wenig zur Ruhe kommen.\r\nFrohe Weihnachten und ein erfolgreiches neues Jahr.', '4eea2b386e3e0.jpg', '2011-12-15 17:19:37', '2011-12-15 18:21:57', 2);
